INSERT INTO `dl_chapitre` VALUES (1,'# Introduction à la programmation avec Javascript et Node.js\n\n## Avertissement\n\n  On trouve sur internet un grand nombre de tutoriels proposant d\'apprendre, par exemple, le javascript en une semaine. Ce n\'est tout simplement pas possible. Si développeur \n  est un travail qui paye aussi bien, c\'est parce qu\'apprendre à programmer est une chose extrêmement longue et complexe.\n\n  Toutefois, si cela peut vous rassurer, c\'est très fun, a bien des égards autant voir plus qu\'apprendre à jouer correctement à un jeu vidéo.\n\nSi vous ne pourrez clairement jamais apprendre à tout faire en quelques semaines, et que vous souffrirez très probablement de la comparaison avec des personnes plus expérimentées que vous,\nce n\'est pas pour autant qu\'il faut vous décourager, au contraire.\n\nL\'idée, pour ne pas se décourager, est de très vite abandonner la motivation qui consiste à \"vouloir apprendre à programmer\". \n\nL\'apprentissage n\'est pas quelque chose d\'amusant, et personnellement, apprendre pour apprendre ne m\'a jamais procuré la moindre motivation de\nlong terme. Celle-ci risque de s\'effriter au premier blocage rencontré, et\nde laisser un goût amer lorsque l\'on aura abandonné.\n\nApprendre à programmer, pour bien se faire, ne dois pas être un but, mais\nle résultat d\'un autre but beaucoup plus motivant.\n\nIl faut donc le plus vite possible remplacer la volonté d\'apprendre par une volonté de \"construire un truc\", ou de \"résoudre un problème\", pour lequel vous \nallez devoir passer par l\'étape d\'apprendre à programer. En effet, \nl\'essence même de la programmation consiste en ceux deux éléments : résoudre des problèmes, construire des trucs.\n\nÉvitez de vous comparer aux autres, parce qu\'entre avoir passé deux cents\nheures et quatre cents heures à essayer d\'obtenir le niveau de quelqu\'un\nqui code depuis quinze ans, vous n\'aurez pas vue le but se rapprocher d\'un\npoil.\n\nToutefois, si vous voulez juste\ntrouver un problème, le résoudre, trouver un petit programme à créer, \nle construire, vous allez sauter de petites victoires en petites victoires,\nen devenant chaque fois meilleur, vous pourrez ensuite revenir sur des\nproblèmes que vous avez pris une nuit à résoudre pour finalement les réussir en une minute, et vous pourrez ainsi être satisfait du chemin\naccompli.\n\nComme il s\'agira de petites taches, et que vous sentirez parfois avoir \npresque finit quelque chose à la fin de votre journée, vous serez capable\nsans trop d\'effort d\'investir les heures nécessaires au fait de devenir\nbon. \n\n## Un contenu généraliste:\n\n  Ce document a pour but de permettre à une personne n\'ayant jamais touché à la programmation\nde s\'approprier les principes de base permettant de développer une **application** simple en **javascript**.\nLe but sera de permettre à toute personne qui suit le cours d\'être capable de créer ces deux applications à la fin du cours:\n  * Un jeu d\'aventure textuelle avec des menus pour la première partie.\n  * Un jeu de dé dans le navigateur web pour la seconde partie.\n\n  Si vous réussissez cela, vous devriez être capable de réussir haut la \n  main n\'importe quelle formation diplomante pour devenir développeur d\'application.\n\nDans un premier temps, les applications que nous apprendrons à concevoir ne feront que deux choses:\nafficher du texte, et demander à l\'utilisateur de saisir du texte. Cela demandera d\'apprendre les bases\nsur la façon dont fonctionne un **ordinateur**, ce qu\'est un **système d\'exploitation**, ce que fait\nconcrètement un programme, et ce qu\'est un **terminal**.\n    \n  Ensuite, une fois les bases acquises, nous verrons comment créer une petite application web que l\'on\npeut visiter dans un navigateur comme firefox ou Google Chrome. Au passage, nous devrons apprendre ce qu\'est\ninternet, ce qu\'est un serveur, ce que fait un navigateur web, et nous devrons également apprendre les bases\ndu HTML et CSS.\n\n\n\n\n## Une pédagogie orientée projet:\n\n  La programmation étant un domaine où l\'on est très souvent confronté à l\'inconnu, le cours ne va pas être\norganisé classiquement avec une partie théorique suivie d\'une partie pratique. Au contraire, nous procéderons\nà une démarche inverse :  nous proposerons **d\'abord les exercices**, puis nous mettront ensuite **le cours théorique**,\nlui-même entrecoupé d\'exercices où le but est de deviner comment fonctionne le code sans avoir vu le concept\nau préalable. En effet, de notre expérience, le code ne peut s\'apprendre, et n\'est amusant à apprendre, qu\'en le\npratiquant. Et pratiquer le code, c\'est **essayer par tous les moyens de résoudre un problème.**.\nLe but est de stimuler la volonté de lire le cours par l\'utilité qu\'il a pour résoudre un problème drôle à résoudre.\n\n  La démarche attendu face à un cours est donc la suivante:\n    \n  * Lire les exercices\n  * Ne rien y comprendre\n  * Lire le cours.\n  * Ne pas comprendre grand chose\n  * Tomber sur un exemple de code auquel on ne comprend rien\n  * Essayer de deviner ce qu\'il fait\n  * Lire la suite du cours et réaliser que l\'on s\'est planté\n  * Se rappeler de l\'énoncé d\'un exercice, et se dire qu\'avec les connaissances que l\'on vient d\'acquérir, il\n  est bien possible que l\'exercice soit devenu faisable\n  * Se planter.\n  * Continuer à lire le cours.\n  * Ne pas y comprendre grand chose, mais réaliser que l\'on est moins ignorant qu\'au début\n  * Refaire l\'exerice\n  * Penser qu\'on l\'a réussi, crier de joie \n  * Lire la solution de l\'exercice, réaliser que l\'on s\'est planté, mais en comprenant là où l\'on s\'est planté\n  * Relire le cours, en ayant cette fois une idée de ce qu\'il se passe\n  * Passer à une nouvelle section de cours\n  * Retour à l\'étape 2.\n\nBonne chance\n\n','Introduction à la programmation',0,42,2,'<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/OzdsrbRFbOg?si=gFeqTr2Qq15h-B5D\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen></iframe>'),(2,'# ZLEDA \n\n## Cahier de charges\n\n---\n\nLe but de ce projet va être de créer un jeu de rôle textuelle à l\'aide de Java.\n\nLe joueur incarnera une équipe de quatre personnages parcourant un donjon, ayant pour but de sauver\nla princesse ZLEDA (toute ressemblance avec une oeuvre existante serait fortuite).\n\nLe jeu fonctionne selon le principe suivant: pour chaque événement dans le jeu, le joueur reçoit un texte lui décrivant l\'événement et les choix qu\'il peut faire. \nEn entrant un nombre permettant de déterminer ce qu\'il choisit de faire parmis les options proposés dans un menu, un autre événement se déclenche.\n\nLe but sera de diriger une équipe d\'aventurier ppour parcourir un donjon jusqu\'à trouver pièce où est enfermée la princesse ZDLEA.\n\nLes personnnages possèdent les **caractéristiques** de base suivantes:\n\n * force : influe sur les dégâts infligés par les attaques physiques\n * magie : influs sur les dégâts infligés par les attaques magiques\n * vitalité : influe sur les points de vie du personnage\n * esprit : influe sur les points de mana du personnage\n * points de vie : entiers positifs impactés par les attaques ennemis et les soins alliés, signifiant la mort du joueur s\'ils tombent à zéro\n * points de vie max : entier strictement positif impacté par la montée de niveau.\n * niveau : entier strictement positif servant à indiquer la puissance générale d\'un personnage.\n * attaques physiques : répertoire d\'attaques physiques connues des\npersonnages. Les attaques physiques consomment des points de vie\nlorsqu\'elles sont lancées.\n\nSi nous ne donnerons pas d\'indication sur l\'équilibrage général du jeu, il faudra tout de même respcter les principes suivants lors de la création des attaques.\nElles fonctionnent un peu à la façon de League of Legends:\n\n* Elles ont des dégâts de base. Par exemple, coup de tête va infliger à coup sur 50 points de dégâts à un ennemi.\n* Elles ont des dégâts dépendants des caractéristiques des personnages. Par exemple, coup de tête va infliger, en plus de ses 50 points de dégâts\n de base, 70% de la force de celui qui le lance. Ainsi, si mon barbare\n  avec 100 de forces lance coup de têtes, il infligera 50 + 100*(70/100) = \n  120 points de dégâts à l\'ennemi (théoriquement)\n* Elles ont une portion de dégâts variables. Par exemple, coup de tête possède 20% de dégâts variables. Sachant que l\'attaque inflige 120 points de dégâts avant variation, elle peut infliger 120 +- 20%, soit de 96 à 144 points de dégâts.\n\nLe donjon est une suite de salles avec au maximum quatre portes.\n Chaque salle peut posséder un **événement**\n   \nUn **événement** est quelque chose qui arrive de façon aléatoire lorsque l\'on rentre dans une pièce. Les événements peuvent être de différents types:\n\n* Apparition d\'un groupe d\'ennemi\n* Découverte d\'un trésor\n* Découverte d\'un feu de camp\n* Rien\n\nA noter que l\'existence de trésor implique soit l\'existence d\'objets à utiliser au\ncombat ou en dehors, soit l\'existence d\'une monnaie à récolter pour obtenir des points.\nLibre à vous d\'implémenter ces fonctionnalité comme bon vous semble.\n\nUne fois que l\'événement est terminé, le joueur peut alors traverser une porte, menant à une autre salle. Chaque salle possède également des portes et un événement.\nUltimement, une des salles devrait contenir ZDELA, et le joueur devrait\navoir finit le jeu une fois cette salle atteinte.\n\n## Ouverture\n\n---\n\nIl ne s\'agit ici que d\'une base pour le projet. Vous pouvez l\'agrémenter de toutes les fonctionalité qui vous passent par la tête, ou même en faire un simulateur d\'aventure\nen dehors d\'un donjon. Si vous voulez implémenter des résistances magiques et physiques, un marchand, des nouvelles classes, des nouveaux sorts, allez-y. Le principe\nderrière la programmation est que l\'on peut théoriquement tout faire, donc ne vous sentez pas\nlimité par l\'énoncé.\n','Présentation du projet',2,42,3,'<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Osqf4oIK0E8?si=BgXD3zKMVeEPS4zX\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen></iframe>'),(3,'# Heading 1\n## Heading 2\n### Heading 3\n#### Heading 4\n\n**Bold Text**\n\n*Italic Text*\n\n~~Strikethrough Text~~\n\n---\n\n1. Ordered List Item 1\n2. Ordered List Item 2\n   1. Nested Ordered List Item\n3. Ordered List Item 3\n\n- Unordered List Item 1\n- Unordered List Item 2\n  - Nested Unordered List Item\n- Unordered List Item 3\n\n> Blockquote: This is a blockquote.\n\n[Link](https://www.example.com)\n\n![Image Alt Text](https://placekitten.com/200/300)\n\n`Inline Code`\n\n```python\n# Code Block\ndef hello_world():\n    print(\"Hello, World!\")\n```\n\n| Header 1 | Header 2 | Header 3 |\n|----------|----------|----------|\n| Row 1, Col 1 | Row 1, Col 2 | Row 1, Col 3 |\n| Row 2, Col 1 | Row 2, Col 2 | Row 2, Col 3 |\n| Row 3, Col 1 | Row 3, Col 2 | Row 3, Col 3 |\n\n| Left-aligned | Center-aligned | Right-aligned |\n|:-------------:|:--------------:|:-------------:|\n| Left          | Center         | Right         |\n\n- [x] Task 1\n- [ ] Task 2\n- [ ] Task 3\n\nThis is some text with a footnote[^1].\n\n[^1]: Here is the footnote content.\n\nTerm 1\n:   Definition 1\n\nTerm 2\n:   Definition 2\n','Test markdown',0,42,1,'<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Up6ivGBBSzY?si=slh87qmHALyvKP8f\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen></iframe>'),(4,'# Création du premier programme.\n\n## Exercices :\n\n1) Créer un programme qui permet d\'afficher la phrase \"Pk la vie?\" en stockant\nchaque mot dans une variable et en concaténant ces variables dans la fonction\n\"console.log\"\n\n2) Créer un programme qui permet de calculer la somme, la différence, la divison\net le produit de 2424 par 8979. Une fois cela fait, changer 2424 par\n4242. Faite ensuite en sorte que le fait de changer ce nombre ne nécessite le changement\nque d\'une instruction dans votre code.\n\n3) Créer un programme qui permet d\'afficher la valeur d\'une température en degrés\nFarenheit pour les valeurs suivantes en degré Celsius:\n10, 20, 30, 40, 50\n\n4) le fichier erreur.js est un fichier javascript contenant des erreurs.\nIl contient également une structure de contrôle qui n\'a pas été vu dans ce cours.\nEn utilisant le message d\'erreur, essayez tout d\'identifier et de corriger l\'erreur\ndans ce fichier\n\n## Cours :\n\nReprenons le code que nous avons vu dans la section sur les bases d\'un programme: \n \n ```javascript\n let hello = \"Hello \"\n let world = \"World!\"\n console.log(hello + world);\n ```\nDans VSCode, copiez coller le code dans un fichier hello.js, ouvrez un terminal, \net tappez la commande suivante:\n\n ```bash\n node .\\hello.js\n ```\n\nSeriez-vous capable de deviner le sens des signes suivants, et la raison pour\nlaquelle votre terminal afficher \"Hello World!\" à l\'exécution du programme :\n\nlet, =, \", console, log, +\n\nEssayez de chercher un peu la logique sous-tendant le fonctionnement de ce \nprogramme et poursuivez.\n\nTout d\'abord, regardons le mot clé let.\nVous rappelez-vous des principes que nous avions énoncer sur les \ndifférents composants d\'un ordinateur? Pour manipuler des informations, les\nprocesseurs ont besoin d\'aller les récupérer dans la mémoire.\nLe rôle de **let** est de déclarer une **variable**, soit un espace dans la mémoire\nportant un nom, et contenant ce qui suit le signe =.\n\nA partir de cela, vous il est possible de deviner le sens de **=**. Il s\'agit d\'un\n**opérateur d\'assignation**, qui, placé après la déclaration d\'une variable, permet\nde donner le contenu de la variable.\n\nLe signe **\"**, quant à lui, est là pour déclarer le début ou la fin d\'une chaine de\ncaractère. Dans cette ligne:\n\n ```javascript\n let hello = \"Hello \"\n ```\n\n On peut observer que la chaine de caractère est colorée d\'une façon différente du \n reste du programme. Cette chaine est \"Hello\".\n La caractéristique d\'une chaine de caractère, c\'est qu\'elle permet d\'afficher des \n lettres lorsque l\'on donne certaines instructions pour les manipuler. Raison pour\n laquelle s\'est affiché Hello World dans votre terminal lorsque vous avez lancé le\n programme.\n\n Si donc on reprend la ligne plus haut:\n  * **let** sert à déclarer une variable\n  * hello sert à déclarer le nom de notre variable\n  * **=** sert à signifier que l\'on assigne à la variable ce que l\'on met à droite du signe\n  * le premier **\"** permet de déclarer l\'ouverture de la chaine de caractères.\n  * Hello est le contenu de la chaine de caractère\n  * le deuxième **\"** permet de fermer la chaine de caractères\n\n Ensuite, observons le rôle de console.log.\n Vous l\'aurez peut être deviné, il s\'agit de la partie du code qui est responsable \n du fait que nos chaines de caractères se soient affichées. Il s\'agit en fait d\'une\n **fonction** (ou plus exactement, d\'une fonction appartenant à un objet appelé\n console). Nous verrons plus en détail plus tard ce que fait une fonction, et encore\n après ce qu\'est un objet, mais rappelez vous de ceci: une **fonction est un \n morceau de code s\'appelant en tappant son nom et en rajoutant des parenthèses\n à la fin**. Ces fonctions vont ensuite exécuter une suite d\'instructions prédéfinies.\n Elles peuvent prendre des arguments dans ces parenthèses, et ainsi effectuer un\n traitement sur les données que l\'on va leur passer en paramètre.\n\nMaintenant, que fait l\'opérateur **+**? Et bien, tout simplement, il sert à concaténer\nles deux chaines de caractères. Ainsi, grâce à +, \"Hello \" + \"World\" deviennent\n\"Hello World\"\n\nLes points virgules à la fin des lignes, quant à eux, signifient juste la fin \nd\'une instruction\n\nPrenons maintenant un autre programme:\n\n ```javascript\n let num1 = 3;\n let num2 = 6;\n num1 = num1 + num2;\n console.log(num1 + num2);\n ```\n\nAvant de l\'exécuter, essayez de deviner ce qui sera affiché dans votre terminal.\n\nVoici donc la réponse : ce programme affiche 9.\nEn effet les variables ne contiennent pas des chaines de caractère, mais des nombres.\nEt sur les nombres, les opérateurs mathématiques comme + et - permettent de faire\ndes opérations entre eux.\n\nIl existe plusieurs opérateurs mathématiques :\n\n  * \'+\' : additionne deux nombres\n  * \'-\' : fait la différence entre deux nombres\n  * \'*\' : fait la multiplication entre deux nombres\n  * \'/\' : fait la division entre deux nombres\n  * \'%\' : récupère le reste d\'une division entre deux nombres\n\nLa priorité des opérateurs est semblable à celles des mathématiques: on fait d\'abord ce \nqu\'il y a entre parenthèses, puis les multiplications et divisions dans l\'ordre, puis\nles additions et soustractions dans l\'ordre.\n\nDeux plus, il existe quelques raccourcis pour écrire certaines opérations:\n\n ```javascript\n let num1 = 3;\n let num2 = 6;\n console.log(\"num1 sans avoir changé sa valeur : \" + num1);\n num1++;\n console.log(\"num1 après incrémenation via l\'opérateur ++: \" +num1);\n num1--;\n console.log(\"num1 après décrémentation via l\'opérateur --: \" +num1);\n num1 += num2;\n console.log(\"num1 après ajout de la valeur de num2 à num1 via +=: \" +num1);\n num1 -= num2;\n console.log(\"num1 après soustraction de la valeur de num2 à num1 via +=: \" +num1);\n ```\n\n ++ permet d\'incrémenter la valeur de la variable de 1.\n\n -- permet de décrémenter la valeur de la variable de 1.\n\n += permet d\'incrémenter la valeur de la variable du nombre passé à droite de l\'opérateur. \n\n -= permet de décrémenter la valeur de la variable du nombre passé à droite de l\'opérateur.\n\n\n### Gérer les bugs:\n\nIl arrive très fréquemment, lorsque l\'on code, que l\'on écrive des choses qui ne sont pas \ncompréhensibles par l\'ordinateur.\nDans ce cas, lorsque l\'on essaiera d\'exécuter le programme, il est probable de se retrouver \nface à un message d\'erreur comme celui-ci:\n\n ```\n/home/hijokaidan/Documents/ProjetsCode/jsCourse/ch02/p01/test.js:1\nconsole.log(\"hello workd);\n            ^^^^^^^^^^^^^^\n\nSyntaxError: Invalid or unexpected token\n    at internalCompileFunction (node:internal/vm:74:18)\n    at wrapSafe (node:internal/modules/cjs/loader:1141:20)\n    at Module._compile (node:internal/modules/cjs/loader:1182:27)\n    at Module._extensions..js (node:internal/modules/cjs/loader:1272:10)\n    at Module.load (node:internal/modules/cjs/loader:1081:32)\n    at Module._load (node:internal/modules/cjs/loader:922:12)\n    at Function.executeUserEntryPoint [as runMain] (node:internal/modules/run_main:81:12)\n    at node:internal/main/run_main_module:23:47\nNode.js v18.13.0\n ```\n\nPour bien comprendre ce genre de message, il est important de savoir le lire.\nIci, nous avons affaire à **une erreur de syntaxe**.\nEn effet, lorsque l\'on ouvre une chaine de caractère avec une \", il ne faut pas oublier\nde la fermer avec une autre \".\nLe message va également indiquer la ligne ou l\'erreur a été levé, et vous pourrez\nla corriger en suivant les indications que vous donnent le message d\'erreur.\n\n','Créer son premier programme',0,42,4,'<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/XAGCULPO_DE?si=x2kQr8pPtNTXs5Wo\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen></iframe>'),(5,'# MPA contre SPA\n\nHTMX et la question de l\'architecture REST s\'inscrit dans un contexte de changement de paradigme dans la conception des applications web. Avec PHP, les JSP, Ruby On Rails, on voyait l\'architecture d\'un site web comme **une collection de pages différentes d\'un même domaine reliées entre elles par des liens hypermédias.** \n\nCe terme de liens hypermédias fait tout simplement référence à deux choses : la balise \\<a> contenant un hyperlien vers une autre page web, et le \\<input type=\"submit\"> des formulaires, effectuant des requêtes posts vers le serveur.\n\nL\'architecture d\'un site web basée sur l\'idée d\'un ensemble de pages différentes encodées en HTML par le serveur puis envoyées pour interprétation au client, on l\'appel **MPA** (pour Multi Page Application).\n\nAinsi, rien ou peu de choses ne sont exécutées coté client dans une MPA, le rendu du HTML étant délégué au serveur.\n\nSi cela fonctionnait, l\'approche posait tout de même quelques soucis : \n\n * Chaque navigation d\'une page vers l\'autre demandait un rechargement complet de la page. Cela pouvait être mauvais pour l\'UX.\n * L\'envoie d\'un formulaire demandait également un rechargement complet de la page.\n * Un site web ne pouvait presque rien proposer en fonctionalités si la connexion réseau était défaillante. Ainsi, une connexion lente ou inconsistente rendait l\'expérience utilisateur catastrophique.\n* Naviguer sur une page demandait à chaque fois de récupérer tous les scripts de celles-ci, même s\'ils sont les mêmes pour toutes les pages. Du fait que les publicité demandent le chargement généralement lent d\'un très grand nombre de scripts, cela pouvait rendre l\'expérience très douloureuse.\n\n Est alors apparue l\'idée de la **SPA**. La philosophie est la suivante : on ne charge plus le serveur de créer le HTML, on lui demande juste de répondre à des requêtes effectuées par javascript avec un format de données que javascript pourra comprendre et interpréter. A partir des ces données, c\'est du javascript exécuté coté client qui va construire le HTML s\'affichant dans le navigateur. \n \n Donc, quand l\'utilisateur va se connecter à un site, il ne va demander qu\'une seule page qui va lui servir un gros paquet de javascript. Ensuite, le javascript va construire du HTML en fonction des interactions de l\'utilisateur avec ce HTML. Pour récupérer des données dans une base, il fera appel à une API du serveur back lui renvoyant des données au format JSON.\n\n Ainsi, plus de temps de latence dans la navigation entre les différentes vues, plus besoin de charger tous les scripts chaque fois que l\'on en change, on peut implémenter facilement des fonctionnalités hors ligne, on peut même faire ce que l\'on appel de la mise à jour optimiste (c\'est à dire mettre à jour des données dépendantes de la base sans avoir encore reçu la réponse du serveur contenant la mise à jour des données).\n\n C\'est ainsi qu\'a prospéré l\'écosystème javascript, et qu\'ont émergé les différents frameworks comme Angular, React, Vue, Grecha.js, etc.\n\n Parfait, problème réglé n\'est-ce pas ?\n','Historique',0,23,1,'<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/8OHc8av11sA?si=3t53gCW7xiQ4cpGx\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen></iframe>'),(6,'# Restful vs Restless\n\nL\'idée derrière une application REST, selon l\'inventeur du terme Roy Fielding, est une série de contrainte sur la façon d\'architecturer le web pour permettre l\'existence d\'applications fiables et \"stateless\".\n Pour qu\'une application soit stateless, il faut que la requête soit la seule information nécessaire à retenir pour le serveur afin déterminer les données à envoyer. Il n\'a pas besoin d\'un historique des requêtes précédentes du client pour lui donner sa réponse, il a juste besoin de ce que contient la requête.\n\nEt c\'est effectivement le cas des API JSON : le but de celles-ci est de récupérer une requête formattée d\'une certaine façon, de définir des règles de gestion de ses requêtes, et d\'envoyer une réponse en fonction de la requête. Alors, pourquoi ces API ne sont-elles pas RESTful ?\n\nObservons tout d\'abord que le JSON n\'est pas ce avec quoi l\'on interagit. On interagit avec ce que le javascript a fait du JSON. Et ce javascript peut faire ce qu\'il veut de ces données : il peut les modifier, les supprimer, en ajouter sans que cela ne reflète l\'état de la base de données. Les API JSON ont donc beau être stateless, la façon dont le client reçoit les données ne l\'est pas, car l\'interprétation du message en quelque chose de lisible pour le navigateur nécessite l\'intervention du javascript. Et toutes les implémentations de l\'interprétation des données par javascript ne vont pas être RESTful.\n\nC\'est pour éviter cela que Roy Fielding a imposé une autre contrainte pour préserver cet aspect de \"statelessness\" : la nécessite d\'interface uniforme pour tout le web.\n\nCette contrainte demande de répondre aux exigences suivantes :\n\n* L\'identification des ressources dans la requête : la requête doit contenir un identifiant de la ressource qu\'elle souhaite récupérer du serveur. \n\n* La manipulation de la ressource par sa représentation : la réponse d\'un serveur ne doit pas simplement permettre de représenter l\'état de la ressource, mais doit également définir les actions possibles sur l\'état de cette ressource. Par exemple, si l\'on souhaite pouvoir faire en sorte qu\'un client puisse modifier son nom et son prénom sur une page web, la réponse à la requête de la page web doit contenir un moyen de le faire. En HTML, se sera un formulaire qui ira faire une requête POST vers un autre point de l\'API. Cela a l\'intérêt de ne pas nécessiter un client particulier pour pouvoir faire une requête de modification ou de délétion à partir des données envoyées du serveur.\n\n<blockquote>\nPrenons ici un exemple concret : imaginons le cas où l\'on met à jour le format des données à envoyer au serveur pour changer ses informations personnelles. Supposons par exemple que le genre soit passer d\'un booléen à une sélection entre différents choix. Maintenant, supposons que tous les utilisateurs soient comme vous et moi, et ne ferment jamais leurs onglet du navigateur. Il n\'ont donc pas rechargé la page depuis la mise à jour. Il ont donc toujours l\'ancien formulaire, qui va envoyé un booléen au back, alors que celui-ci attend maintenant une chaine de caractères. Le back, voyant que la requête envoyée n\'est pas compatible avec le schéma de donner qu\'il attend, va lever une erreur.\n\nQue se passe-t-il sur une MPA si j\'envoie des modifications de mon profil avec le vieux formulaire ? Vu que j\'aurai une erreur dans ma requête, et que soumettre un formulaire provoque un rechargement complet de la page, je recevrai comme réponse le nouveau formulaire avec un message d\'erreur. \n\nPar contre, sur une SPA, mon javascript va effectuer une requête vers le back, qui va répondre avec un status 400, et le javascript utilisera cette information pour m\'afficher une erreur. Mais comme la réprésentation de cette erreur ne décrit pas la façon dont je peux interagir avec les ressources, renvoyer des informations de ce formulaire provoquera toujours la même erreur. Jusqu\'à ce que j\'ai la présence d\'esprit de réactualiser la page en désactivant le cache.\n</blockquote>\n\n\n* Les messages envoyés doivent être auto-descriptifs. Il faut que les messages envoyés par le back contiennent une description de la façon dont ils doivent être interprétés. Par exemple, si le header `content-type` est `text/html`, le client doit juste posséder un parser de HTML pour le comprendre et le manipuler. \n\n<blockquote>\nC\'est un des problèmes du JSON : si un parser de JSON est évidemment nécessaires pour l\'interpréter, il n\'est pas suffisant pour créer une interface utilisateur : il nécessite l\'intermédiaire du javascript. Or le JSON ne contraint pas le client sur la façon dont il doit l\'interpréter : un même objet peut être interprété différement par deux clients différents. Supposons par exemple un cas caricatural : une API JSON renvoie pour l\'URL \"api/utilisateur\" une structure de données avec des clés ne contenant qu\'une seule lettre. Comment faire alors pour s\'assurer que le client n\'affiche pas le nom à la place du prénom, etc.?\n</blockquote>\n\n* HATEOAS : Hypermedia As The Engine Of Application State. Les réponses envoyées par le serveur doivent être suffisantes pour manipuler l\'état de l\'application et s\'y déplacer.\n\nSi ces contraintes ont été formulées, ce n\'est pas (seulement) pour embêter les développeurs. Et dire que les SPA ne respectent pas le REST n\'est pas simplement les attaquer pour le non respect d\'un principe abstrait.\n\nSi nous avons donner ici quelques exemples très simple de soucis rencontrés avec les SPAs. Mais les problèmes liés à la maintenance, à la gestion de version à la gestion de session, à la synchronisation des données entre back et front est un soucis de tous les instants. Voici quelques problèmes auxquels réfléchir pour vous donner une idée de cela:\n\n* Si un utilisateur n\'a pas de rôle administrateur, je ne souhaite pas le laisser accéder à certains points de l\'API, ni à certaines pages de mon front. J\'utilise pour cela un système où mon serveur crypte des informations qu\'il envoie dans un cookie. Il utilise cette même clé pour l\'encryption et la décryption. Je ne peux donc évidemment pas la passer au client, où il pourrait utiliser la clé pour créer un faux cookie et se donner des droits d\'administrateur. Comment faire pour m\'assurer que l\'utilisateur n\'ai pas le droit d\'accéder au pages d\'administrateur du front sans qu\'il puisse simplement modifier un \"ROLE_VISITEUR\" en \"ROLE_ADMIN\" dans le localstorage ?\n\n* Si cela vous parait compliqué, rajoutons quelques contraintes supplémentaires. Supposons que je possède une base de données sur Microsoft Azure contenant des adresses email de personnes autorisées à utiliser l\'application. Cependant, je n\'ai pas ces informations dans ma base de données. Si donc une personne se connecte avec une adresse microsoft autorisée mais inconnue de ma base de données, je dois le rediriger vers une page d\'inscription. Cette page d\'inscription ne doit pas être visible d\'une personne qui ne s\'est pas connecté via microsoft. Une personne qui s\'est connectée via Microsoft mais n\'est pas encore inscrite ne doit pas pouvoir avoir accès à d\'autres pages que la page d\'inscription. Comment m\'assurer d\'avoir coté front à chaque fois des informations non faciles à modifier par l\'utilisateur permettant de répondre à toutes ces contraintes ?\n\n* Maintenant, un exemple plus simple : supposons que vous avez une petite \"checkmark\" à coté d\'un cours sur un site de e-learning (exemple au hasard), sur laquelle vous pouvez appuyer pour indiquer que vous l\'avez terminé.\nSoucieux d\'avoir une application réactive, vous utilisez du javascript pour faire une mise à jour optimiste de votre checkmark. Après tout, si un utilisateur appuie sur une checkmark bleue, elle doit devenir verte, et inversement, pas besoin de réponse du back pour faire ça non ? Avant de continuer, voici la façon dont les checkmarks sont gérées coté back : il existe une table nommée \"flag_cours\" qui lie un utilisateur à un cours, et possède des propriétés comme la date de dernière consultation d\'un cours, son temps passé dessus, etc., et un booléen pour dire si l\'utilisateur a terminé son cours. On crée un enregistrement dans cette table dès lors qu\'un utilisateur consulte un cours pour la première fois, et ensuite on modifie cet enregistrement chaque fois que l\'utilisateur interagit avec le cours. Voici la façon dont on récupère les flags du cours : on fait une recherche à partir de l\'id du cours et de l\'utilisateur, et ensuite on change le booléen chargé d\'indiquer si le cours est terminé ou non. Supposons maintenant qu\'un petit malin décide de dire qu\'il a terminé son cours sans jamais l\'avoir consulté. Que va-t-il se passer coté back ? Et que va voir l\'utilisateur ? Que se passera-t-il lorsqu\'il rechargera la page ?\n\n* Ayant anticipé le petit malin, vous avez décidé de vérifier si la requête renvoyait un message d\'erreur, auquel cas vous réinitialiser la checkmark à l\'état d\'avant la requête.\nVous corrigez également le bug coté back dans la foulée pour créer la relation entre l\'utilisateur et le cours si elle n\'existe pas encore. Mais vous avez tout de même implémenté une méthode envoyant un message dans le cas où un utilisateur indique qu\'il a finit un cours sans l\'avoir consulté. Problème, cette méthode a un bug et lance une exception. Cependant, elle la lance après avoir persisté les données. Que va-t-il se passer?','Restful vs Restless',0,23,2,'<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/BGUklQz98Hg?si=Z_FSYp-1ftCwCGCa\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen></iframe>'),(7,'# HTMX, ou l\'avénement de HATEOAS dans une application SPA.\n\nOn peut donc voir que dans la transition en MPA et SPA, on effectue un pari risqué : amener, pour potentiellement améliorer l\'expérience utilisateur, une gigantesque usine à bugs dans son stack.\n\nAu délà de ces problèmes, on rencontre également des soucis spécifiques au fait de créer deux applications au lieu d\'une seule : **productivité réduite**, **nécessité de dupliquer de la logique** (car toute logique métier dans le front doit nécessairement être répliquée dans le back), **nécessité d\'avoir deux builds pour ses applications**, **nécessité d\'utiliser plus d\'outils**, donc plus grande spécialisation des équipes, ce qui crée généralement une équipe front et une équipe back qui doivent être capables de communiquer, etc. La liste est longue.\n\nCependant, à l\'ère contemporaine, difficile de faire une application MPA qui ne fasse pas vieillote, et le retour en arrière semble impossible.\n\nMais c\'est ici qu\'arrive HTMX. Avec une simplicité d\'utilisation surprenante, cet outil permet de transformer des MPA en applications \"transitives\" entre MPA et SPA, et de **créer des applications réactives gérant l\'état des ressources du serveur par Hypermédia, sans nécessité de rechargement de page**. Nous verrons comment cela est fait dans le prochain cours','HATEOAS',0,23,3,'<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/sTzF57GE4-k?si=1oDu0W6MS1iEOa0M\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen></iframe>'),(8,'# Principes de base de HTMX\n\nL\'idée derrière HTMX est d\'étendre les possibilités des attributs HTML pour leur donner de nouvelles fonctions possibles.\n\nAvec HTMX, il est possible de rajouter des attributs tels que n\'importe lequel élément du DOM est capable d\'effectuer un\nappel au backend. Le résultat de cet appel peut ensuite être utilisé pour remplacer une partir du DOM de la page.\n\nAinsi, voilà à quoi peut ressembler un lien de navigation HTML utilisant HTMX :\n\n```html\n<div>\n    <a\n        class=\"flex  flex-col text-primary items-center hover:cursor-pointer\"\n        hx-get=\"/agenda/api\"\n        href=\"/agenda\"\n        hx-push-url=\"/agenda\"\n        hx-swap=\"innerHTML transition:true\"\n        hx-target=\"#insert\"\n>\n<div class=\"rounded-full overflow-hidden\">\n```\n\nPour l\'instant, nous ne verrons pas spécifiquement à quoi servent les différents éléments. Retenez juste que vous pouvez les placer n\'importe où dans le HTML\n\nAinsi, HTMX propose de charger des fragments de pages et d\'en remplacer sans avoir à effectuer un rafraichissement\ncomplet de celle-ci. \n\nCela nécessite donc d\'avoir **un backend qui va générer du HTML**, et non renvoyer du JSON.\n\nPour cela, il est conseillé d\'utiliser coté backend un **moteur de templating**, comme Twig pour PHP, Thymeleaf pour Java ou les templates Django pour python. Normalement, vous devriez avoir vu les bases de Thymeleaf avant d\'avoir vu ce cours. Si ce n\'est pas déjà fait, faites au moins en sorte de connaitre un langage / framework backend et un moteur de templating. Cela peut être tout simplement PHP (même si utiliser du PHP pur expose votre appli aux XSS).','Introduction',0,24,1,'<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/G9RpHfPyEx8?si=2LAoVKwm8tyZAQCm\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen></iframe>'),(9,'# Faire une requête AJAX avec HTMX\n\nSupposons que nous ayons une application nous permettant de tirer de l\'inspiration d\'une phrase aléatoire du script de \"The Bee Movie\" au simple clique d\'un bouton. On stockera ces phrases dans une base de donnée gérée par le backend.\n\nMaintenant, voilà à quoi devrait ressembler notre page HTML dans une application MPA classique : \n\n```html\n<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n    <meta charset=\"UTF-8\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <meta name=\"description\" content=\"BEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEE\">\n    <title>Bee Movie Inspiration</title>\n</head>\n<body>\n    <header>\n        <h1>BEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEE</h1>\n    </header>\n    <section id=\"citation\">\n        <h2>You like Jazz ?</h2>\n    </section>\n    <form>\n        <button type=\"submit\">Inspire me !</button>\n    </form>\n    <script>\n        setInterval(() => {\n            console.log(\"bzzzzzzzzzzzzzzzzzzzz\");\n        }, 100);\n    </script>\n</body>\n</html>\n```\n\nUne section d\'id citation contenant la citation dans une balise h2, un titre parlant possédant ce qu\'il faut en mots clés, une description pour les moteurs de recherche, et un formulaire avec un bouton qui enverra une requête POST vers le back.\n\nCette requête POST va recharger la page entière pour nous montrer une nouvelle citation. Cependant, nous ne souhaitons recharger que de la page que la citation. Le titre, le script et le bouton ne vont pas changer avec la requête; aussi, il est inutile de les recharger. Aussi, comme nous ne postons rien, mais que nous demandons une ressource au serveur, il serait plus judicieux de ne changer que le contenu de la balise h2.\n\nCela devient possible grâce aux attributs HTMX suivants :\n * hx-get\n * hx-target\n * hx-swap \n\n Ainsi, si l\'on a un controleur du back capable de renvoyer du HTML formatté de cette façon sur la route \"/bee\" :\n\n ```html\n <h2>{{ citation }}</h2>\n ```\n\n où `citation` est une citation aléatoire de the Bee Movie obtenue de la base de données, avec ce code :\n\n```html\n<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n    <meta charset=\"UTF-8\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <meta name=\"description\" content=\"BEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEE\">\n    <script src=\"https://unpkg.com/htmx.org@1.9.6\" integrity=\"sha384-FhXw7b6AlE/jyjlZH5iHa/tTe9EpJ1Y55RjcgPbjeWMskSxZt1v9qkxLJWNJaGni\" crossorigin=\"anonymous\"></script>\n\n    <title>Bee Movie Inspiration</title>\n</head>\n<body>\n    <header>\n        <h1>BEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEE</h1>\n    </header>\n    <section id=\"citation\">\n        <h2>You like Jazz ?</h2>\n    </section>\n    <button \n    hx-get=\"/bee\"\n    hx-target=\"#citation\"\n    hx-swap=\"innerHTML\"\n    >Inspire me !</button>\n    <script>\n        setInterval(() => {\n            console.log(\"bzzzzzzzzzzzzzzzzzzzz\");\n        }, 100);\n    </script>\n</body>\n</html>\n```\nil est maintenant possible de ne changer que la balise h2 lors du clique sur le bouton !\n\nFaisons maintenant un tour du code que nous avons changé par rapport à la MPA classique.\n\n * Tout d\'abord, nous avons inclue la librairie htmx via le CDN dans la partie head de notre fichier HTML. C\'est sous cette condition que peuvent fonctionner les attributs HTMX.\n\n * Ensuite, nous avons supprimer le formulaire et laissé le bouton seul. En effet, nous ne soumettons aucune donnée, il ne s\'agit donc pas réellement d\'un formulaire. Et grâce à HTMX, nous n\'avons pas besoin de mettre les données dans un formulaire pour faire une requête au back.\n\n * hx-get=\"/bee\" permet de préciser qu\'à l\'activation de cet élément HTML (par défaut le clique), HTMX va effectuer une requête AJAX à l\'URL \"/bee\"\n\n* hx-target=\"#citation\" permet de préciser à HTMX qu\'il va devoir utiliser la réponse à la requête pour changer l\'élément HTML désigné par le sélecteur CSS entre guillemet par le contenu de la réponse. Ici, il va donc remplacer le contenu de la section avec l\'id \"citation\" par une autre citation\n\n* hx-swap=\"innerHTML\" permet de préciser quel partie de l\'élément visé l\'on souhaite remplacer.\n\nPour vous donner une idée de ce que permet de faire cette librairie, voici le code javascript nécessaire pour obtenir le même effet sur ce bout de HTML :\n\n```javascript\ndocument.querySelector(\"button\").addEventListener(\"click\", (e) => {\n    fetch(\"/bee\").then( (res) => {\n        let citation = document.querySelector(\"#citation\");\n        citation.innerHTML = res;\n    })\n})\n```\ntout en prenant en compte le fait que ce code risque de casser le jour où l\'on décide de mettre un deuxième bouton dans la page.\n\n','Faire une requête AJAX avec HTMX',0,24,2,'<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/e_Ue_P7vcRE?si=SkgcWk82lMR42DBc\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen></iframe>');
