INSERT INTO `dl_cours` VALUES (1,1,'Le navigateur web et le HTML',1,1,NULL,2),(2,1,'Un langage de balisage',2,2,NULL,2),(3,1,'Styliser son HTML',3,3,NULL,2),(4,1,'Organiser son HTML avec flexbox',3,4,NULL,2),(5,1,'Organiser son HTML avec grid',3,5,NULL,3),(6,1,'Les animations CSS',4,6,NULL,3),(7,1,'Le framework Bootstrap',2,7,NULL,3),(8,1,'Le framework Tailwind',4,8,NULL,3),(9,2,'Dynamiser une page web',1,1,NULL,3),(10,2,'Déclarer une variable',2,2,NULL,3),(11,2,'Les conditions',2,3,NULL,3),(12,2,'Les boucles',3,4,NULL,2),(13,2,'Les fonctions',3,5,NULL,4),(14,2,'Les objets littéraux et le JSON',4,6,NULL,2),(15,2,'Les classes',4,7,NULL,2),(16,2,'Debugger son javascript',2,8,NULL,2),(17,3,'Manipuler le DOM',3,1,NULL,2),(18,3,'Écouter les événements',3,2,NULL,2),(19,3,'La programmation asynchrone : les promesse',5,3,NULL,2),(20,3,'Faire des requêtes : découverte de l\'API fetch',3,4,NULL,2),(21,3,'Programmation asynchrone : introduction à RXJS',5,5,NULL,2),(22,3,'Introduction à typescript',3,6,NULL,2),(23,6,'REST, HATEOAS et gestion de l\'état d\'une application',3,1,'Vous avez surement déjà entendu parlé de l\'architecture REST. Pour beaucoup, cela consiste à avoir des controlleurs qui prennent requête et renvoient du JSON en réponse. Pourtant, il s\'agit d\'un abus de langage. Nous verrons comment cet abus de langage a entrainé des pratiques impliquant des architectures pour les applications web propices à tout une série de bug, et comment le principe d\'HyperMédia peut y remédier.\n\n Ainsi, nous pourrons mieux comprendre l\'intérêt de la librairie Javascript faisant l\'objet de cette série de cours : HTMX.',2),(24,6,'Introduction à HTMX',2,2,'Dans ce chapitre, nous allons voir comment HTMX fonctionne, avec quels outils l\'utiliser et comment commencer à l\'utiliser dans un projet simple.',2),(26,6,'Gérer un formulaire avec HTMX',3,4,NULL,2),(27,6,'Gérer une navigation type SPA dans HTMX',4,5,NULL,2),(28,6,'Gérer les erreurs avec les headers HTTP',4,6,NULL,2),(29,7,'Introduction à Thymeleaf et aux moteurs de templating',3,1,NULL,2),(30,7,'Afficher des variables dans un template thymeleaef',3,2,NULL,4),(31,7,'Créer des fragments',4,3,NULL,3),(32,7,'Expressions littérales et conditions',3,4,NULL,2),(33,7,'Les différents attributs thymeleaf',4,5,NULL,2),(34,7,'L\'itération',3,6,NULL,2),(35,7,'Fonctions avancées sur les fragments',4,7,NULL,3),(36,7,'Structure d\'un projet Thymeleaf + HTMX',3,8,NULL,3),(37,7,'Gérer l\'état via l\'URL',2,9,NULL,3),(38,7,'Créer des composants réutilisables avec Tailwind',3,10,NULL,2),(39,8,'Introduction : qu\'est qu\'un VCS',1,1,NULL,2),(40,8,'git init, git add, git commit',2,2,NULL,1),(41,5,'Création d\'un projet angular',3,1,NULL,2),(42,30,'Introduction au cours',1,1,'Ce cours a pour but de vous faire découvrir les bases de la programmation, plus que de vous faire apprendre un langage en particulier. Le but est d\'affuter votre esprit pour le rendre capable d\'appréhender des problèmes, de les déstructurer en petites étapes réalisables à atteindre les unes à la suite des autres, pour enfin offrir une solution convenable à ce problème.\n',1);
