INSERT INTO `dl_fil_discussion` VALUES (1,'Madame Thibaudeau m\'a dis \"Vous êtes trop stupide pour rentrer\" ???',1,1,0,78,0,'2023-11-17 00:01:56','Hier, alors que je venais de rendre mon test sur java objet (pour lequel j\'ai obtenu une note bien plus grande que 0 !), j\'envoie un mail à Mme Thibeaudeau pour lui dire \"c\'est bon je peux paser ?\", et voici ce qu\'elle me répond ?????? SANDALEUX !!!!!!'),(2,'Règles du forum',NULL,1,0,6,1,'2023-11-17 03:03:59','En tant que reponsable de la formation, je me dois de vous communiquer les informations concernant les règles générales du forum'),(3,'Bonne idée de s\'inscrire et ne jamais venir pour frauder pôle emploi ?',1,0,0,1998,1,'2023-11-18 00:20:37','Travailler au Mac Do, très peu pour moi, mais je ne veux pas être totalement inutile et ne rien faire de mes journées pour autant. Pour cela, je voudrais donc éviter d\'être développeur. Est-ce une bonne idée selon vous de m\'inscrire en CDA DATA pour travailler sur mes projets personnels sans que pôle emploi ne soit sur mon dos ?'),(4,'Javascript était une grave erreur',7,0,0,1999,0,'2023-11-18 00:22:37','https://en.wikipedia.org/wiki/JSFuck'),(5,'Qu\'en est-il des débouchés pour un développeur en Assembleur ?',1,0,0,194,0,'2023-11-18 00:38:55','Bonjour, avant de prendre cette formation en Alternance pour devenir développeur assembleur, je me demandais si des anciens pouvaient me confirmer qu\'il existait des offres d\'emploi dans ce domaine ?'),(8,'HTMX est une dinguerie',7,0,0,1997,0,'2023-11-23 22:56:10','Je ne sais pas trop si vous connaissez HTMX, mais la technologie est vraiment incroyable. Il s\'agit d\'une méthode qui permet de ne pas avoir à séparer l\'application back et front en deux parties. Un peu comme si vous pouviez faire du PHP, mais avec toutes les qualités d\'une SPA'),(9,'Pourquoi apprendre un langage aussi horrible ?',2,0,0,1997,0,'2023-11-23 23:02:51','Voulez-vous nous faire souffrir inutilement ?'),(10,'Le meilleur tuto react de tous les temps',7,0,0,1997,0,'2023-11-23 23:36:56','https://www.youtube.com/watch?v=XAGCULPO_DE\n'),(12,'Neovim : meilleur éditeur pour le front-end',7,0,0,1997,0,'2023-11-23 23:49:45','Neovim >>>> Vscode'),(29,'Pensez-vous que l\'argent vaille le coup ?',2,0,0,1997,0,'2023-11-24 11:17:05','J\'ai parfois l\'impression d\'être l\'équivalent d\'un cordiste intellectuel : on me paye bien pour un métier qui va cependant énormément affecter ma santé... mentale.'),(30,'Hyperscript : cobol pour le front end',11,0,0,1997,0,'2023-11-24 11:18:27','https://hyperscript.org/\nJ\'ai regardé j\'ai envie de m\'arracher les yeux'),(31,'le stack MSTH : Mariadb Spring Thymeleaf HTMX',7,0,0,1997,0,'2023-11-24 11:57:28','Le meilleur stack, dont HTMX est une composante clé (sinon ça fait un stack MST)'),(33,'test transition',1,0,0,1997,0,'2023-11-27 23:19:40','oui'),(34,'test transition 2',1,0,0,1997,0,'2023-11-27 23:20:12','ouiii\n'),(35,'Le diplôme est-il reconnu par l\'état ?',5,0,0,1997,0,'2023-11-28 09:36:15','Je me demandais si le diplôme délivré par Diginamic était reconnu par l\'état.'),(36,'Un Bac + 5 ingénieur data après un CDA Java, bonne ou mauvaise idée ?',1,0,0,1997,0,'2023-12-07 21:56:54','Je sors actullement d\'un CDA Java, mais le marché est relativement tendu en ce moment. D\'un autre coté, j\'ai l\'impression que la Data embauche énormément ces derniers temps. Est-ce une bonne idée de se reconvertir une nouvelle fois ?'),(37,'Bonjour j\'aime le boulgour',1,0,0,1997,0,'2023-12-12 17:01:37','J\'adour le boulgour');
