INSERT INTO `dl_post_forum` VALUES (1,78,'Pour qui se prend-elle ???','2023-11-20 11:53:51.000000',1,NULL),(2,6,'Diginamic est une organisation tenant aux valeurs humaines et à la qualité de vie lors de la formation. Si la liberté est importante dans ce cadre, il convient tout de même de se plier à certaines règles nécessaires au bien être de tous dans le forum. Les voici :\n    * Il est important de respecter ses collègues et les formateurs. Si les pics, les moqueries, les remarques passives-agressives peuvent se faire dans le contexte d\'une discussion privée, vous êtes dans un contexte professionnel, et aucune remarque de ce type ne sera tolérée.\n    * Si cela va de soi, il est également d\'inerdit d\'insulter, de menacer, de harceler, de diffamer ou de persécuter un autre membre du forum. De même pour les remarques racistes, sexistes, homophobes, xénophobes, ou tout autre propos discriminatoire. Il ne s\'agit pas simplement d\'une règle du forum, mais de la loi.\n    * Il est interdit de poster des messages à caractère pornographique, ou contenant des liens vers des sites pornographiques. De même, il est interdit de poster des liens vers des sites de téléchargement illégaux, ou des liens vers des sites de streaming illégaux.\n    * Il est interdit de poster des messages à caractère politique ou religieux. Il est également interdit de poster des messages à caractère publicitaire, ou de faire de la publicité pour un site ou un produit.\n    * Si les formateurs peuvent se tromper, ils sont là pour vous aider. Il est donc important de les respecter, et de ne pas les insulter ou les menacer. Si vous avez un problème avec un formateur, vous pouvez en parler avec lui, ou avec un autre formateur, ou avec la direction. Mais il est inutile de s\'en prendre à lui sur le forum.\n','2023-11-20 15:39:56.000000',2,NULL),(3,6,'De la même façon, avant de solliciter un formateur pour une question sur le forum, essayez de faire vos propres recherches et de vous entraider. Sauf pour la PNL. Ne faites pas de recherche sur la PNL','2023-11-21 13:46:40.000000',2,NULL),(4,89,'???','2023-11-21 14:59:06.000000',1,NULL),(5,99,'https://jean-michel.jar','2023-11-21 15:00:40.000000',1,NULL),(8,1997,'Et bien il y en a...\n.\n.\n.\n.\n.\nà l\'assemblée ! xDxDxD','2023-11-22 17:06:35.184566',5,NULL),(9,1997,'XD','2023-11-22 17:07:18.861557',5,NULL),(10,1999,'Il y a eu des meurtres pour moins que ça','2023-11-22 17:11:52.240036',5,NULL),(11,1999,'https://github.com/Cyber-cicco/projet-node','2023-11-22 17:13:02.886594',4,NULL),(12,1,'Bonjour.','2023-11-22 17:13:43.974615',5,NULL),(13,1,'En tant que formateur, mais également modérateur de ce forum, je ne peux accepter de tel propos.\nSupprimez tous les deux vos messages.','2023-11-22 17:17:23.510835',5,NULL),(14,1,'<script>alert(\"caca\")</script>','2023-11-22 17:21:23.235561',4,NULL),(15,1,'bonjour','2023-11-22 17:22:17.075937',5,NULL),(16,1,'j\'aime le boulgour','2023-11-22 17:22:25.474267',5,NULL),(17,1,'pendant la saison des amours','2023-11-22 17:22:34.646378',5,NULL),(18,1,'j\'écoute Charles Aznavour','2023-11-22 17:23:18.696325',5,NULL),(20,1,'et je fais des calembours','2023-11-22 17:23:57.020034',5,NULL),(21,1,'sur la mère d\'Éric Zemmour','2023-11-22 17:24:08.857012',5,NULL),(22,1,'Mais bien sur Abel','2023-11-22 17:50:14.207046',3,NULL),(23,1,'Je suis Richard','2023-11-22 17:50:26.574105',3,NULL),(24,1997,'test','2023-11-22 18:06:47.280527',5,NULL),(25,1997,'bonjour','2023-11-22 18:13:51.279767',4,NULL),(26,1997,'j\'aime le boulgour','2023-11-22 18:13:59.020983',4,NULL),(27,1,'moi aussour','2023-11-22 18:14:23.699595',4,NULL),(28,1997,'jeaera','2023-11-23 11:29:44.140279',5,NULL),(29,1997,'etst','2023-11-23 11:51:28.260289',5,NULL),(30,1997,'test','2023-11-23 11:51:30.581112',5,NULL),(31,1997,'test','2023-11-23 11:51:32.977312',5,NULL),(32,1997,'test','2023-11-23 11:51:35.311579',5,NULL),(33,1997,'test','2023-11-23 11:51:37.264585',5,NULL),(34,1997,'tets','2023-11-23 11:51:40.560133',5,NULL),(35,