idez une réponse, la correction est apportée en ligne.<br>\n- En fin de QCM, une note sur 20 est affichée, mais à l\'examen final, le score attendu est de 65 % de bonnes réponses : votre note doit donc être > 13/20<br>\n<br>\n<table class=\'table table-bordered table-striped order-list\'>\n	<thead><th class=\'bg-dgn\'>Test</th><th class=\'bg-dgn\'>URL</th></thead>\n	<tbody>\n		<tr>\n			<td>1</td><td><a class=\"text-info\" href=\"http://evalbox.com/register/exam/code/EVB73L2XZ94M\">URL</a></td>\n		</tr>\n		<tr>\n			<td>2</td><td><a class=\"text-info\" href=\"http://evalbox.com/register/exam/code/VP59B2HMYWX8\">URL</a></td>\n		</tr>\n		<tr>\n			<td>3</td><td><a class=\"text-info\" href=\"http://evalbox.com/register/exam/code/4DXPH9AU8Y8H\">URL</a></td>\n		</tr>\n		<tr>\n			<td>4</td><td><a class=\"text-info\" href=\"http://evalbox.com/register/exam/code/CJD94BYSBQPQ\">URL</a></td>\n		</tr>\n		<tr>\n			<td>5</td><td><a class=\"text-info\" href=\"http://evalbox.com/register/exam/code/53BR8V5XPPL7\">URL</a></td>\n		</tr>\n		<tr>\n			<td>6</td><td><a class=\"text-info\" href=\"http://evalbox.com/register/exam/code/ZSDKTK7MSJFV\">URL</a></td>\n		</tr>\n		<tr>\n			<td>7</td><td><a class=\"text-info\" href=\"http://evalbox.com/register/exam/code/K8W2MAW6MLED\">URL</a></td>\n		</tr>\n		<tr>\n			<td>8</td><td><a class=\"text-info\" href=\"http://evalbox.com/register/exam/code/N5EK4V78HB77\">URL</a></td>\n		</tr>\n	</tbody>\n</table>','Non','rbonnamy@diginamic.fr',168,1,77,'11','- Maîtriser la programmation objet et le langage JAVA en environnement JEE ;\n- Construire des interfaces graphiques avec HTML5 / CSS3 / JS / Bootstrap / Angular ;\n- Utiliser les principaux frameworks de présentation et de gestion des données ;\n- Gérer les tests et l\'intégration continue des développements ;\n- Maîtriser le cycle de vie d’un projet JAVA et l’industrialisation des développements ;\n- Appliquer les bonnes pratiques de développement dans un contexte agile ;\n- Travailler et communiquer au sein d\'une équipe projet.',NULL,NULL,'Maîtrise d’un langage orienté objet (JAVA,\nC#, …) et des fondamentaux web (HTML,\nJavaScript, CSS)','Jeune diplômé(e) en informatique, titulaire d\'un BAC +3 / BAC+4 / BAC+5, $NOM.SOCIETE te propose un CDI en tant que développeur en informatique, précédé d\'une formation gratuite professionnalisante d\'une durée de 57 jours, afin de te rendre immédiatement opérationnel(le) pour les missions confiées par nos clients.\nAssurée par des professionnels reconnus, cette formation pratique vise à compléter et concrétiser les connaissances nécessaires pour la conception, le développement et la maintenance des applications JAVA en environnement JEE, associée à l’ensemble des technologies et frameworks utilisés en entreprise, coté back-end comme front-end.\nL’industrialisation des développements, la gestion des tests et l’intégration continue, ainsi que la conduite de projet Agile dans un contexte Scrum, sont également présentées et mises en pratique dans le cadre d’un projet fil rouge.\nDes tests seront réalisés afin de valider que les acquis et prérequis ont bien été assimilés, et cette formation s\'achève par le passage de la certification JAVA SE d’Oracle.\nAu-delà de la technique, cette formation vise également à apporter les clefs d’une intégration humaine réussie au sein d’une équipe et à offrir une compétence professionnelle reconnue, associant Savoir, Savoir-Faire et Savoir-Être !',NULL),(137,'\0',NULL,'2019-02-01 13:16:48.477000','Consultant Business Intelligence','Consultant BI','CDBI',57,0,NULL,NULL,NULL,0,0,NULL,'Non','rbonnamy@diginamic.fr',138,13,130,'13','A l\'issue de ce parcours de formation, les participants seront en mesure de :\n1.  Appréhender l\'état de l\'art des principales solutions BI du marché et maîtriser le cycle de vie d\'un projet BI;\n2.  Appréhender les bonnes pratiques du de développement dans un contexte agile ;\n3.  Développer avec les solutions d\'alimentation de données (DataStage, SSIS, Talend O