l Stack','.NET Full-Stack','CDM1',57,0,NULL,NULL,'MICROSOFT C#',700,3,NULL,'Non','rbonnamy@diginamic.fr',171,16,134,'16','- Concevoir et développer des applications complètes .NET (C#, ASP.NET MVC, WPF, ADO.NET, Entity) ;\n- Concevoir et développer des modules Front-end (HTML5, CSS3, Bootstrap, JavaScript, Angular);\n- Maîtriser le cycle de vie d\'un projet et l\'industrialisation des développements ;\n- Appliquer les bonnes pratiques de développement dans un contexte Agile ;\n- Travailler et communiquer au sein d\'une équipe projet.',NULL,NULL,'Maîtrise des bases du développement\n.NET et de la programmation orientée\nobjet','Jeune diplômé(e) en informatique, titulaire d\'un BAC +3 / BAC+4 / BAC+5, $NOM.SOCIETE te propose un CDI en tant que développeur informatique, précédé d\'une formation gratuite professionnalisante d\'une durée de 57 jours, afin de te rendre immédiatement opérationnel(le)\npour les missions confiées par nos clients.\nAssurée par des professionnels reconnus, cette formation pratique vise à compléter et concrétiser les connaissances nécessaires pour la conception, le développement et la maintenance des applications .NET en environnement Microsoft, associée à l’ensemble des technologies et\nframeworks utilisés en entreprise.\nL’industrialisation des développements, la gestion des tests et l’intégration continue, ainsi que la conduite de projet Agile dans un contexte Scrum, sont également présentées et mises en pratique dans le cadre d’un projet fil rouge.\nDes tests seront réalisés afin de valider que les acquis et prérequis ont bien été assimilés, et cette formation s\'achève par le passage de la certification Microsoft C# programming.\nAu-delà de la technique, cette formation vise également à apporter les clefs d’une intégration humaine réussie au sein d’une équipe et à offrir une compétence professionnelle reconnue, associant Savoir, Savoir-Faire et Savoir-Être !',NULL),(142,'\0',NULL,'2019-02-01 14:44:10.000000','Business Analyst','Business Analyst','BA1',57,0,NULL,NULL,'Scrum Product Owner',0,1,NULL,'Non','rbonnamy@diginamic.fr',143,22,109,'5','• Appréhender l’écosystème d’un système\nd’informations ;\n• Maîtriser le cycle de vie d’un projet et la\nconception logicielle ;\n• Appréhender les méthodes agiles ;\n• Savoir innover seul ou en équipe ;\n• Spécifier les besoins utilisateurs et valider les\nlivrables logiciels ;\n• Communiquer et gérer la relation au sein de\nl’entreprise.',NULL,NULL,'BAC+5 d’une école d’ingénieur, commerce,\nfinance ou informatique et connaissance\nfonctionnelle du métier','Jeune diplômé(e) en informatique, titulaire d\'un BAC +5, $NOM.SOCIETE te propose un CDI en tant\nque Business Analyst, précédé d\'une formation gratuite professionnalisante d\'une durée de 57\njours, afin de te rendre immédiatement opérationnel(le) pour les missions confiées par nos clients.\nAssurée par des professionnels reconnus, cette formation pratique permet d’acquérir les concepts\nde la Business Analyse, pour bien comprendre et exprimer les exigences de l’organisation et\npermettre d’assurer que la solution finale est bien en adéquation avec les besoins identifiés.\nVéritable chef d’orchestre de la transformation digitale, le Business Analyst intervient dans l’analyse\nd’une problématique métier, la formalisation d’une réponse fonctionnelle, le suivi de la mise en\nœuvre logicelle et la validation des livrables jusqu’à la livraison finale de l’application.\nDes tests seront réalisés afin de valider que les acquis et prérequis ont bien été assimilés, et cette\nformation s\'achève par le passage de la certification Professional Scrum Product Owner.\nAu-delà de la technique, cette formation vise également à apporter les clefs d’une intégration\nhumaine réussie au sein d’une équipe et à offrir une compétence professionnelle reconnue,\nassociant Savoir, Savoir-Faire et Savoir-Être !',NULL),(143,'\0',NULL,'2019-02-01 14:47:22.000000','Business Analyst','Business Analyst','BA1',57,0,NULL,NULL,'Scrum Produc