 Intelligence 4.2',63,0,NULL,'Non','aleforestier@diginamic.fr',148,13,140,'17','1.  Appréhender l\'état de l\'art des principales solutions BI du marché et maîtriser le cycle de vie d\'un projet BI;\n2.  Appréhender les bonnes pratiques du de développement dans un contexte agile ;\n3.  Développer avec les solutions d\'alimentation de données (DataStage, SSIS, Talend, Informatica);\n4.  Développer avec les solutions de restitution de données (SAP BO, MicroStrategy, Qlik Sense);\n5.  Évoluer et communiquer au sein d\'une équipe.','Contexte :\nEn groupe de 4 personnes.\n\nSur une durée de 2 semaines, animé avec la méthodologie agile SCRUM, participation à 2 projets BI :\n- un premier projet concernant une analyse de données pour la grande distribution,\n- le second projet concernant l’analyse de données de la sécurité routière.\n\nMissions :\n- modélisation des entrepôts de données\n- alimentation des entrepôts de données avec l’ETL sélectionné.\n- réalisation des rapports demandés par le client avec l’outil de visualisation sélectionné.\n\nTechnologies utilisées : \nTalend et QlikSense pour le premier projet, SSIS et MicroStrategy pour le second projet.','Une évaluation préalable à la formation a été passée sous forme de QCM en ligne, et l’apprenant a démontré ses compétences de base en gestion de données.','Maîtrise des bases du développement\ndécisionnel et de la programmation\norientée objet','Jeune diplômé(e) en informatique, titulaire d\'un BAC +5, $NOM.SOCIETE te propose un CDI en tant\nque développeur décisionnel, précédé d\'une formation gratuite professionnalisante d\'une durée de\n57 jours, afin de te rendre immédiatement opérationnel(le) pour les missions confiées par nos\nclients.\nAssurée par des professionnels reconnus, cette formation pratique vise à compléter et concrétiser\nles connaissances nécessaires pour la conception, le développement et la maintenance des\napplications Business Intelligence, associée à l’ensemble des technologies et frameworks u