e durée de 57 jours, afin de te rendre immédiatement opérationnel(le) pour les missions confiées par nos clients.\nAssurée par des professionnels reconnus, cette formation pratique vise à compléter et concrétiser les connaissances nécessaires pour la conception, le développement et la maintenance des applications JAVA en environnement JEE, associée à l’ensemble des technologies et frameworks utilisés en entreprise, coté back-end comme front-end.\nL’industrialisation des développements, la gestion des tests et l’intégration continue, ainsi que la conduite de projet Agile dans un contexte Scrum, sont également présentées et mises en pratique dans le cadre d’un projet fil rouge.\nDes tests seront réalisés afin de valider que les acquis et prérequis ont bien été assimilés, et cette formation s\'achève par le passage de la certification JAVA SE d’Oracle.\nAu-delà de la technique, cette formation vise également à apporter les clefs d’une intégration humaine réussie au sein d’une équipe et à offrir une compétence professionnelle reconnue, associant Savoir, Savoir-Faire et Savoir-Être !',NULL),(169,'\0',NULL,'2019-03-28 13:17:20.946000','Prépa TP2 JAVA','Prépa TP2 JAVA','PTP2M',57,0,NULL,'ORACLE','JAVA SE8',0,3,NULL,'Oui','rbonnamy@diginamic.fr',173,46,163,'13',NULL,NULL,NULL,NULL,NULL,NULL),(170,'\0',NULL,'2019-04-24 16:15:32.802000','Business Analyst','Business Analyst','BA1',57,0,NULL,NULL,'Professional Scrum Product Owner',0,1,NULL,'Non','rbonnamy@diginamic.fr',179,22,150,'9','- Appréhender l’écosystème d’un système d’informations ;\n- Maîtriser le cycle de vie d’un projet et la conception logicielle ;\n- Appréhender les méthodes agiles ;\n- Savoir innover seul ou en équipe ;\n- Spécifier les besoins utilisateurs et valider les livrables logiciels ;\n- Communiquer et gérer la relation au sein de l’entreprise.',NULL,NULL,'BAC+5 d’une école d’ingénieur, commerce,\nfinance ou informatique et connaissance\nfonctionnelle du métier','Jeune diplômé(e) en informatique, titulaire d\'un BAC +5, $NOM.SOCIETE te propose un CDI en tant que Business Analyst, précédé d\'une formation gratuite professionnalisante d\'une durée de 57 jours, afin de te rendre immédiatement opérationnel(le) pour les missions confiées par nos clients.\nAssurée par des professionnels reconnus, cette formation pratique permet d’acquérir les concepts de la Business Analyse, pour bien comprendre et exprimer les exigences de l’organisation et permettre d’assurer que la solution finale est bien en adéquation avec les besoins identifiés.\nVéritable chef d’orchestre de la transformation digitale, le Business Analyst intervient dans l’analyse d’une problématique métier, la formalisation d’une réponse fonctionnelle, le suivi de la mise en œuvre logicelle et la validation des livrables jusqu’à la livraison finale de l’application.\nDes tests seront réalisés afin de valider que les acquis et prérequis ont bien été assimilés, et cette formation s\'achève par le passage de la certification Professional Scrum Product Owner.\nAu-delà de la technique, cette formation vise également à apporter les clefs d’une intégration humaine réussie au sein d’une équipe et à offrir une compétence professionnelle reconnue, associant Savoir, Savoir-Faire et Savoir-Être !',NULL),(171,'\0',NULL,'2019-07-08 14:24:56.622000','Développeur .NET Full Stack','.NET Full-Stack','CDM1',57,0,NULL,NULL,'MICROSOFT C#',700,3,NULL,'Non','rbonnamy@diginamic.fr',NULL,16,141,'17','- Concevoir et développer des applications complètes .NET (C#, ASP.NET MVC, WPF, ADO.NET, Entity) ;\n- Concevoir et développer des modules Front-end (HTML5, CSS3, Bootstrap, JavaScript, Angular);\n- Maîtriser le cycle de vie d\'un projet et l\'industrialisation des développements ;\n- Appliquer les bonnes pratiques de développement dans un contexte Agile ;\n- Travailler et communiquer au sein d\'une équipe projet.',NULL,NULL,'- BAC+2 à BAC+5\n- Maîtrise des bases de la POO et connaissance d\'un langage comme C# ou Java','Jeune diplômé(e) en i