.  Appréhender les bonnes pratiques du de développement dans un contexte agile ;\n3.  Développer avec les solutions d\'alimentation de données (DataStage, SSIS, Talend, Informatica);\n4.  Développer avec les solutions de restitution de données (SAP BO, MicroStrategy, Qlik Sense);\n5.  Évoluer et communiquer au sein d\'une équipe.','DUREE : 4 jours.\nContenu :\nEn groupe de 4 personnes, animé avec la méthodologie agile SCRUM, participation à la mise en place d’un entrepôt de données et de fonctionnalités de reporting permettant d’analyser des données de la sécurité routière. Les différentes missions : modélisation de l’entrepôt, alimentation de l’entrepôt avec l’ETL et réalisations de rapports demandés par le client (victimes niveau de gravité, par catégories d’usagers, par types de trajets, par secteur géographique, sur différentes échelles temporelles. Le client a par ailleurs soumis des maquettes de reporting qu’il faut reproduire).\n\nDUREE : 4 jours.\nContenu :\nEn groupe de 4 personnes, animé avec la méthodologie agile SCRUM, participation à la mise en place d’un entrepôt de données et de fonctionnalités de reporting permettant d’analyser les données des ventes d’une grande entreprise du secteur de la grande distribution. Les différentes missions : modélisation de l’entrepôt, alimentation de l’entrepôt avec l’ETL et réalisations de rapports demandés par le client (Le CA TTC effectué par ses magasins, lE CA HT, la marge, les quantités vendues, le panier moyen par regroupement d’articles, et ce sur différentes échelles temporelles. Le client a par ailleurs soumis des maquettes de reporting qu’il faut reproduire)','Une évaluation préalable à la formation a été passée sous forme de QCM en ligne, et l’apprenant a démontré ses compétences de base en gestion de données.','Maîtrise des bases du développement\ndécisionnel et de la programmation\norientée objet','Jeune diplômé(e) en informatique, titulaire d\'un BAC +5, $NOM.SOCIETE te propose un CDI en tant que développ