namy@diginamic.fr',190,46,177,'16','- Maîtriser la programmation objet et le langage JAVA en environnement JEE ;\n- Construire des interfaces graphiques avec HTML5 / CSS3 / JS  ;\n- Maîtriser les bases de données relationnelles et les requêtes SQL\n- Utiliser l\'API JDBC pour la gestion des données ;\n- Réaliser des tests unitaires ;\n- Appliquer les bonnes pratiques de développement dans un contexte agile ;\n- Travailler et communiquer au sein d\'une équipe projet.',NULL,'Bonne culture numérique, connaissance d\'un langage de programmation, tests de pré-requis techniques et positionnement en entreprise.',NULL,NULL,NULL),(179,'\0',NULL,'2019-09-24 12:50:42.925000','Business Analyst','Business Analyst','BA1',57,0,NULL,NULL,'Professional Scrum Product Owner - PSPO1',85,1,'','Non','rbonnamy@diginamic.fr',472,22,170,'10','- Appréhender l’écosystème d’un système d’informations ;\n- Maîtriser le cycle de vie d’un projet et la conception logicielle ;\n- Appréhender les méthodes agiles ;\n- Savoir innover seul ou en équipe ;\n- Spécifier les besoins utilisateurs et valider les livrables logiciels ;\n- Communiquer et gérer la relation au sein de l’entreprise.','Phase 1 : comprendre\n• Se documenter pour comprendre la problématique\n• Comprendre les utilisateurs, leurs besoins dans le contexte, aller sur le terrain, make a map\n• Rencontrer des experts\n• Synthétiser des persona\n• Lister des hypothèses insights\n• Définir le “BIG” challenge\n\nPhase 2 : idéation/sketching\n• Stoty board\n• Dessiner des idées\n• Parcours utilisateur (détection de nouvelles opportunités)\n\nPhase 3 : prototype et test\n• Prototyper le magasin idéal\n• Prototyper des écrans en mode MVP\n• Tester et améliorer vos solutions\n• Proposition de valeur et Business Model\n\nPhase 4 : proposition de valeur et pitch\n• Pitch\n• Entrainement\n• Jury\n• C\'est la finale','Une évaluation préalable à la formation a été passée sous forme de QCM en ligne, l’apprenant a démontré ses compétences de base en gestion de données','BAC+5 d’une école d’ingénieur, commerce,\nfinance ou informatique et connaissance\nfonctionnelle du métier','Jeune diplômé(e) en informatique, titulaire d\'un BAC +5, $NOM.SOCIETE te propose un CDI en tant que Business Analyst, précédé d\'une formation gratuite professionnalisante d\'une durée de 57 jours, afin de te rendre immédiatement opérationnel(le) pour les missions confiées par nos clients.\nAssurée par des professionnels reconnus, cette formation pratique permet d’acquérir les concepts de la Business Analyse, pour bien comprendre et exprimer les exigences de l’organisation et permettre d’assurer que la solution finale est bien en adéquation avec les besoins identifiés.\nVéritable chef d’orchestre de la transformation digitale, le Business Analyst intervient dans l’analyse d’une problématique métier, la formalisation d’une réponse fonctionnelle, le suivi de la mise en œuvre logicelle et la validation des livrables jusqu’à la livraison finale de l’application.\nDes tests seront réalisés afin de valider que les acquis et prérequis ont bien été assimilés, et cette formation s\'achève par le passage de la certification Professional Scrum Product Owner.\nAu-delà de la technique, cette formation vise également à apporter les clefs d’une intégration humaine réussie au sein d’une équipe et à offrir une compétence professionnelle reconnue, associant Savoir, Savoir-Faire et Savoir-Être !',NULL),(180,'\0',NULL,'2019-05-06 10:15:21.867000','Prépa TP2 JAVA','Prépa TP2 JAVA ATOS','PTP2M-2',57,0,NULL,'ORACLE','JAVA SE8',65,3,'<h5>Lien pour l\'inscription :&nbsp;&nbsp;<a class=\"nopadding text-info\" href=\"http://www.pearsonvue.com/oracle/capva/\">Site PEARSONVUE</a></h5>\n<h5>Une fois inscrit(e), veuillez renseigner votre identifiant candidat et cliquez sur sauvegarder.</h5>\n<br>\n<strong>Accès aux tests Evalbox de préparation à la certif JAVA 8:</strong>\nDes QCM de 77 questions, en autoévaluation, pour vous permettre de mieux vous préparer aux types de 