n s\'achève par le passage de la certification JAVA SE d’Oracle.\nAu-delà de la technique, cette formation vise également à apporter les clefs d’une intégration humaine réussie au sein d’une équipe et à offrir une compétence professionnelle reconnue, associant Savoir, Savoir-Faire et Savoir-Être !',NULL),(226,'\0',NULL,'2019-12-03 10:09:32.863000','Développeur .NET Bloc1','.NET Bloc1','CDNet1',57,0,NULL,NULL,'',NULL,NULL,NULL,'Non','fdumee@gmail.com',NULL,226,NULL,'1','- Concevoir et développer des applications complètes .NET (C#, ASP.NET MVC, WPF, ADO.NET, Entity) ;\n- Concevoir et développer des modules Front-end (HTML5, CSS3, Bootstrap, JavaScript, Angular);\n- Maîtriser le cycle de vie d\'un projet et l\'industrialisation des développements ;\n- Appliquer les bonnes pratiques de développement dans un contexte Agile ;\n- Travailler et communiquer au sein d\'une équipe projet.',NULL,NULL,'- BAC+2 à BAC+5\n- Maîtrise des bases de la POO et connaissance d\'un langage comme C# ou Java','Jeune diplômé(e) en informatique, titulaire d\'un BAC +3 / BAC+4 / BAC+5, $NOM.SOCIETE te propose un CDI en tant que développeur informatique, précédé d\'une formation gratuite professionnalisante d\'une durée de 57 jours, afin de te rendre immédiatement opérationnel(le)\npour les missions confiées par nos clients.\nAssurée par des professionnels reconnus, cette formation pratique vise à compléter et concrétiser les connaissances nécessaires pour la conception, le développement et la maintenance des applications .NET en environnement Microsoft, associée à l’ensemble des technologies et\nframeworks utilisés en entreprise.\nL’industrialisation des développements, la gestion des tests et l’intégration continue, ainsi que la conduite de projet Agile dans un contexte Scrum, sont également présentées et mises en pratique dans le cadre d’un projet fil rouge.\nDes tests seront réalisés afin de valider que les acquis et prérequis ont bien été assimilés, et cette formation s\'achève par le pass