luation préalable à la formation a été passée sous forme de QCM en ligne, et l’apprenant a démontré ses compétences de base en gestion de données.','Maîtrise des bases du développement et connaissance du SQL.',NULL,NULL),(231,'\0',NULL,'2019-12-06 18:13:56.325000','Data Engineer','Data Engineer','BIBD',57,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'lcabon@diginamic.fr',NULL,162,207,'6','A l’issue de ce parcours de formation, les participants seront en mesure de :\n- Appréhender l’état de l’art des principales solutions BI et BigData\n- Maîtriser le cycle de vie d’un projet Data\n- Appréhender les concepts de l’agilité, \n- Maîtriser les outils d’alimentation et de restitution du Business Intelligence\n- Consolider et permettre d’exploiter les données massives des Big Data\n- Evoluer et communiquer au sein d’une équipe',NULL,'Une évaluation préalable à la formation a été passée sous forme de QCM en ligne, et l’apprenant a démontré ses compétences de base en gestion de données.','Maîtrise des bases du développement et connaissance du SQL.','Les data engineers constituent le maillon essentiel du processus de consolidation et de transformation des données de l’entreprise, afin de les rendre facilement accessibles par des Datascientist et/ou Data Analyst, et de développer la croissance de l’entreprise et aiguiller sa stratégie.\nCette formation pratique vise à apporter les connaissances indispensables au traitement de données, à vocation décisionnelle ou marketing. Un panorama des principales solutions du Business Intelligence et du BigData sera dressé, et permettra à l’apprenant de les mettre en œuvre dans le cadre de projets complets, des phases de modélisation des données, d’alimentation puis restitution et visualisation.\nAu-delà des technologies et bonnes pratiques, ce parcours formation vise également à apporter les clefs d’une intégration humaine réussie au sein d’une équipe projet et à offrir une compétence professionnelle reconnue associant Savoir, Savoir-Faire et Savoir-être.',NULL),(232,'\0',NULL,'2019-12-20 10:13:43.090000','Data Analyst','Data Analyst','BIBD-B&D',57,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'aleforestier@diginamic.fr',233,224,230,'4','> Appréhender l’état de l’art des principales solutions BI et BigData\n> Maîtriser le cycle de vie d’un projet Data\n\n> Appréhender les concepts de l’agilité, \n\n> Maîtriser les outils d’alimentation et de restitution du Business Intelligence\n> Consolider et permettre d’exploiter les données massives des Big Data\n\n> Evoluer et communiquer au sein d’une équipe',NULL,'Une évaluation préalable à la formation a été passée sous forme de QCM en ligne, et l’apprenant a démontré ses compétences de base en gestion de données.','Maîtrise des bases du développement et connaissance du SQL.',NULL,NULL),(233,'\0',NULL,'2019-12-20 11:15:13.337000','Data Engineer','Data Engineer','BIBD-B&D',57,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'rbonnamy@diginamic.fr',238,224,232,'5','> Appréhender l’état de l’art des principales solutions BI et BigData\n> Maîtriser le cycle de vie d’un projet Data\n\n> Appréhender les concepts de l’agilité, \n\n> Maîtriser les outils d’alimentation et de restitution du Business Intelligence\n> Consolider et permettre d’exploiter les données massives des Big Data\n\n> Evoluer et communiquer au sein d’une équipe',NULL,'Une évaluation préalable à la formation a été passée sous forme de QCM en ligne, et l’apprenant a démontré ses compétences de base en gestion de données.','Maîtrise des bases du développement et connaissance du SQL.',NULL,NULL),(237,'\0',NULL,'2020-01-07 10:23:45.990000','Spécialiste DEVOPS','DEVOPS','DVO2',57,0,NULL,NULL,NULL,NULL,NULL,NULL,'Oui','aleforestier@diginamic.fr',244,237,NULL,'1','A l’issue de ce parcours de formation, les participants seront en mesure de :\n> Maîtriser les fondamentaux d’un projet informatique et les méthodes agiles\n> Appréhender les différents outils de l\'écosystème DevOps ainsi que leurs limites\n> Utiliser les langages de scripting de base de l\'environnement DevOps \n> Appréhender les besoins métiers et technique afin de les traduire dans une architecture fiable\n> Orchestrer un processus de déploiement applicatif et système afin de garantir une haute disponibilité\n> Communiquer, collaborer et s’affirmer au sein d’une équipe projet',NULL,NULL,'•	Ingénieurs justifiant de connaissances en ingénierie logicielle et système\n•	Connaissance d\'un langage de programmation','DevOps, est un mouvement culturel et professionnel qui vise à améliorer le flux de travail entre les développeurs de logiciels (Dev) et les équipes opérationnelles (Ops). Il vise à concilier réactivité et qualité de service entre le développement et l’exploitation.\nD’un point de vue métier et tâches quotidiennes, le devops va mettre en place, administrer et supporter l’ensemble des systèmes informatiques qui permettent de gagner en fluidité. Concrètement, cela se traduit par :\n	Un déploiement régulier des applications, la seule répétition contribuant à fiabiliser le processus ;\n	Un décalage des tests « au plus tôt » dans le cycle de développement ;\n	Une pratique des tests dans un environnement similaire à celui de production ;\n	Une intégration continue incluant des « tests continus » ;\n	Une boucle d\'amélioration courte ;\n	Une surveillance étroite de l\'exploitation et de la qualité de production via des métriques factuelles.\n\nCette formation pratique vise à apporter les clefs de la démarche DEVOPS associées aux outils indispensables à cette mission. Au-delà des outils et bonnes pratiques, ce parcours vise également à apporter les clefs d’une intégration humaine réussie au sein d’une équipe projet et à offrir une compétence professionnelle reconnue associant Savoir, Savoir-Faire et Savoir-être.',NULL),(238,'\0',NULL,'2020-01-08 09:32:44.641000','Data Engineer','Data Engineer','BIBD-B&D',57,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'aleforestier@diginamic.fr',242,224,233,'6','> Appréhender l’état de l’art des prin