ipe projet',NULL,NULL,'•	Ingénieurs justifiant de connaissances en ingénierie logicielle et système\n•	Connaissance d\'un langage de programmation','DevOps, est un mouvement culturel et professionnel qui vise à améliorer le flux de travail entre les développeurs de logiciels (Dev) et les équipes opérationnelles (Ops). Il vise à concilier réactivité et qualité de service entre le développement et l’exploitation.\nD’un point de vue métier et tâches quotidiennes, le devops va mettre en place, administrer et supporter l’ensemble des systèmes informatiques qui permettent de gagner en fluidité. Concrètement, cela se traduit par :\n	Un déploiement régulier des applications, la seule répétition contribuant à fiabiliser le processus ;\n	Un décalage des tests « au plus tôt » dans le cycle de développement ;\n	Une pratique des tests dans un environnement similaire à celui de production ;\n	Une intégration continue incluant des « tests continus » ;\n	Une boucle d\'amélioration courte ;\n	Une surveillance étroite de l\'exploitation et de la qualité de production via des métriques factuelles.\n\nCette formation pratique vise à apporter les clefs de la démarche DEVOPS associées aux outils indispensables à cette mission. Au-delà des outils et bonnes pratiques, ce parcours vise également à apporter les clefs d’une intégration humaine réussie au sein d’une équipe projet et à offrir une compétence professionnelle reconnue associant Savoir, Savoir-Faire et Savoir-être.',NULL),(252,'\0',NULL,'2020-05-19 14:39:49.545000','Développeur Java Full-stack en FAD - Sans certification','Java Full-Stack FAD','CDJJ4',62,0,'','','',NULL,NULL,'','Non','rbonnamy@diginamic.fr',256,221,225,'3','- Développer une application professionnelle back-end JAVA\n- Réaliser une interface front-end élaborée avec Angular\n- Utiliser les outils associés au cycle de vie d’une application JAVA\n- Appliquer les bonnes pratiques de développement et de collaboration dans un contexte agile\n- Intégrer l’ensemble des composantes technologiques et méthodologies requises sur un projet JAVA FullStack (projet de fin de formation)',NULL,'Une évaluation préalable à la formation a été passée sous forme de QCM en ligne, et l’apprenant a démontré ses compétences de base en programmation objet et connaissance d’un langage de type c# ou java.','Maîtrise d’un langage orienté objet (JAVA,\nC#, …) et des fondamentaux web (HTML,\nJavaScript, CSS)','Jeune diplômé(e) en informatique, titulaire d\'un BAC +3 / BAC+4 / BAC+5, $NOM.SOCIETE te propose un CDI en tant que développeur en informatique, précédé d\'une formation gratuite professionnalisante d\'une durée de 57 jours, afin de te rendre immédiatement opérationnel(le) pour les missions confiées par nos clients.\nAssurée par des professionnels reconnus, cette formation pratique vise à compléter et concrétiser les connaissances nécessaires pour la conception, le développement et la maintenance des applications JAVA en environnement JEE, associée à l’ensemble des technologies et frameworks utilisés en entreprise, coté back-end comme front-end.\nL’industrialisation des développements, la gestion des tests et l’intégration continue, ainsi que la conduite de projet Agile dans un contexte Scrum, sont également présentées et mises en pratique dans le cadre d’un projet fil rouge.\nDes tests seront réalisés afin de valider que les acquis et prérequis ont bien été assimilés, et cette formation s\'achève par le passage de la certification JAVA SE d’Oracle.\nAu-delà de la technique, cette formation vise également à apporter les clefs d’une intégration humaine réussie au sein d’une équipe et à offrir une compétence professionnelle reconnue, associant Savoir, Savoir-Faire et Savoir-Être !',NULL),(253,'\0',NULL,'2020-02-14 13:34:06.736000','Consultant BI #FAD','BI #FAD','CDBI-2',47,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'aleforestier@diginamic.fr',263,243,250,'3','> Appréhender l’état de l’art des principales solutions BI du marché et maîtriser le cycle de vie d’un projet BI,  \n> Appréhender les bonnes pratiques de développement dans un contexte agile\n> Développer avec les solutions d’alimentations de données (DataStage, Talend Open Studio, Informatica), \n> Développer avec les solutions de restitution de données (Power BI, SAP BO, Microstrategy),\n> Evoluer et communiquer au sein d’une équipe projet.',NULL,'Une évaluation préalable à la formation a été passée sous forme de QCM en ligne, et l’apprenant a démontré ses compétences de base en gestion de données.','Bac+2 à Bac+5 justifiant de connaissance en traitement des données 5excel, SGBD ...)',NULL,NULL),(254,'\0',NULL,'2020-02-25 14:40:58.454000','Data Engineer FAD','Data Engineer FAD','BIFAD',57,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'aleforestier@diginamic.fr',257,254,NULL,'1','A l’issue de ce parcours de formation, les participants seront en mesure de :\n- Appréhender l’état de l’art des principales solutions BI et BigData\n- Maîtriser le cycle de vie d’un projet Data\n- Appréhender les concepts de l’agilité, \n- Maîtriser les outils d’alimentation et de restitution du Business Intelligence\n- Consolider et permettre d’exploiter les données massives des Big Data\n- Evoluer et communiquer au sein d’une équipe',NULL,'Une évaluation préalable à la formation a été passée sous forme de QCM en ligne, et l’apprenant a démontré ses compétences de base en gestion de données.','Maîtrise des bases du développement et connaissance du SQL.','Les data engineers constituent le maillon essentiel du processus de consolidation et de transformation des données de l’entreprise, afin de les rendre facilement accessibles par des Datascientist et/ou Data Analyst, et de développer la croissance de l’entreprise et aiguiller sa stratégie.\nCette formation pratique vise à apporter les connaissances indispensables au traitement de données, à vocation décisionnelle ou marketing. Un panorama des principales solutions du Business Intelligence et du BigData sera dressé, et permettra à l’apprenant de les mettre en œuvre dans le cadre de projets complets, des phases de modélisation des données, d’alimentation puis restitution et visualisation.\nAu-delà des technologies et bonnes pratiques, ce parcours formation vise également à apporter les clefs d’une intégration humaine réussie au sein d’une équipe projet et à offrir une compétence professionnelle reconnue associant Savoir, Savoir-Faire et Savoir-être.',NULL),(255,'\0',NULL,'2020-02-28 10:08:09.205000','DEVOPS JAVA','DEVOPS JAVA','DVOJ',57,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'aleforestier@diginamic.fr',258,255,NULL,'1','• Maîtriser les fondamentaux d’un projet informatique et les méthodes agiles \n• Appréhender les différents outils de l\'écosystème DevOps ainsi que leurs limites \n• Utiliser les langages de scripting de base de l\'environnement DevOps  \n• Développer une application JAVA avec Spring \n• Orchestrer un processus de déploiement applicatif en DevOps \n• Communiquer, collaborer et s’affirmer au sein d’une équipe projet',NULL,NULL,'Ingénieurs justifiant de connaissances en ingénierie logicielle ou système',NULL,NULL),(256,'\0',NULL,'2020-05-19 14:38:53.663000','Développeur Java Full-stack en FAD - Sans certification','Java Full-Stack FAD','CDJJ4',62,0,'','','',NULL,NULL,'','Non','rbonnamy@diginamic.fr',NULL,221,252,'4','- Développer une application professionnelle back-end JAVA\n- Réaliser une interface front-end élaborée avec Angular\n- Utiliser les outils associés au cycle de vie d’une application JAVA\n- Appliquer les bonnes pratiques de développement et de collaboration dans un contexte agile\n- Intégrer l’ensemble des composantes technologiques et méthodologies requises sur un projet JAVA FullStack (projet de fin de formation)',NULL,'Une évaluation préalable à la formation a été passée sous forme de QCM en ligne, et l’apprenant a démontré ses compétences de base en programmation objet et connaissance d’un langage de type c# ou java.','Maîtrise d’un langage orienté objet (JAVA,\nC#, …) et 