.fr',268,241,241,'2','Concevoir et développer des composants d\'interface utilisateur en intégrant les recommandations de sécurité :\n•	Maquetter une application\n•	Développer une interface utilisateur\n•	Développer des composants d\'accès aux données\n•	Développer les parties backend et front-end d\'une interface utilisateur web\n2. Concevoir et développer la persistance des données en intégrant les recommandations de sécurité :\n•	Concevoir une base de données\n•	Mettre en place une base de données\n•	Développer des composants dans le langage d\'une base de données\n3. Concevoir et développer une application multicouche répartie en intégrant les recommandations de sécurité\n•	Collaborer à la gestion d\'un projet informatique et à l\'organisation de l\'environnement de développement\n•	Concevoir une application\n•	Développer des composants métier\n•	Construire une application organisée en couches\n•	Développer une application mobile\n•	Préparer et exécuter les plans de tests d\'une application\n•	Préparer et exécuter le déploiement d\'une application',NULL,'Une évaluation préalable à la formation a été passée sous forme de QCM en ligne, et l’apprenant a démontré ses compétences de base en programmation objet et connaissance d’un langage de type .Net.',NULL,NULL,NULL),(260,'\0',NULL,'2020-03-10 13:19:23.614000','TP2- Concepteur Dev JAVA FS bloc2 (hors prépa exam)','TP2 Dev JAVA bloc2 ATOS','CDFS2-2',252,0,'1ZO - 808','ORACLE','JAVA SE 8 Programmer',65,2,NULL,'Oui','fdumee@gmail.com',291,181,245,'6',NULL,NULL,NULL,NULL,NULL,NULL),(261,'\0',NULL,'2020-04-14 09:04:38.169000','Data Analyst','Data Analyst','BIBDSOPRA',57,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'rbonnamy@diginamic.fr',NULL,223,227,'3','> Appréhender l’état de l’art des principales solutions BI et BigData\n> Maîtriser le cycle de vie d’un projet BI ou BigData  \n\n> Appréhender les concepts de l’agilité, \n> Gérer l’alimentation des données avec Datastage et Talend Open Studio et la restitution de données déc