 par rapport aux années précédentes déjà très positives. La vente de produits sur internet a certes joué un rôle d’amortisseur économique pour les magasins physiques, mais elle a également amorcé une mutation plus profonde des acteurs de la vente.  Aujourd\'hui, de nombreux e-commerçant se tournent vers des solutions efficaces et fiables pour créer leur boutique en ligne. Parmi ces solutions, Prestashop est devenu en quelques années, la référence du marché, étant complète, évolutive et open-source.\nCette formation vous permettra d\'acquérir les notions essentielles au développement d\'applications e-commerce avec Prestashop, basé sur le Framework PHP Symfony',NULL),(423,'\0',NULL,'2021-05-12 09:58:45.090000','TP6 CDA JAVA 819h 100%ALT',NULL,'CDFS3',380,0,NULL,NULL,NULL,NULL,NULL,NULL,'Oui','rbonnamy@diginamic.fr',433,419,419,'2',NULL,NULL,NULL,NULL,NULL,NULL),(424,'\0',NULL,'2021-05-17 07:24:13.814000','TP5 Dev web et mobile - Tronc commun','TP5 Dev web et mobile - Tronc commun','PTP5 TC',89,0,'Maîtrise de la qualité en projet Web V4-FR','OPQUAST SAS, Bordeaux','Certification OPQUAST',500,0,'1.Comprendre les exigences des utilisateurs du Web et savoir répondre à leurs attentes\n2.Prendre en compte la diversité des usages, prévenir les risques et améliorer l’inclusion\n3.Consolider sa pratique avec des checklists et savoir les argumenter\n4.Maîtriser les bases du vocabulaire et communiquer avec l’ensemble des acteurs du projet Web\n5.Connaître les métiers, disciplines et s’intégrer dans les processus de conception du projet Web','Oui','fdumee@diginamic.fr',432,332,412,'12','1.	Maquetter une application.\n2.	Réaliser une interface utilisateur web statique et adaptable.\n3.	Développer une interface utilisateur web dynamique en intégrant les recommandations de sécurité.\n4.	Réaliser une interface utilisateur avec une solution de gestion de contenu ou e-commerce.\n5.	Créer une base de données.\n6.	Développer les composants d\'accès aux données.\n7.	Développer la partie 