ines et s’intégrer dans les processus de conception du projet Web','Oui','hcrevan@diginamic.fr',NULL,332,424,'13','1.	Maquetter une application.\n2.	Réaliser une interface utilisateur web statique et adaptable.\n3.	Développer une interface utilisateur web dynamique en intégrant les recommandations de sécurité.\n4.	Réaliser une interface utilisateur avec une solution de gestion de contenu ou e-commerce.\n5.	Créer une base de données.\n6.	Développer les composants d\'accès aux données.\n7.	Développer la partie back-end d\'une application web ou web mobile en intégrant les recommandations de sécurité.\n8.	Elaborer et mettre en œuvre des composants dans une application de gestion de contenu ou e-commerce.',NULL,'Une évaluation préalable à la formation a été passée sous forme de QCM en ligne, et l’apprenant a démontré ses compétences de base en programmation objet et connaissance d’un langage de développement.',NULL,NULL,NULL),(433,'\0',NULL,'2021-08-23 09:04:36.704000','TP6 CDA JAVA 819h 100%ALT',NULL,'CDFS3',383,0,NULL,NULL,NULL,NULL,NULL,NULL,'Oui','rbonnamy@diginamic.fr',434,419,423,'3',NULL,NULL,NULL,NULL,NULL,NULL),(434,'\0',NULL,'2022-01-14 16:43:34.182000','TP6 CDA JAVA 819h 100%ALT',NULL,'CDFS3',381,0,NULL,NULL,NULL,NULL,NULL,NULL,'Oui','rbonnamy@diginamic.fr',437,419,433,'4',NULL,NULL,NULL,NULL,NULL,NULL),(435,'\0',NULL,'2021-09-07 15:53:27.848000','Développeur-se Expert Java Full Stack','FAD','FAD',85,0,'Maîtrise de la qualité en projet Web V4-FR','OPQUAST SAS, Bordeaux','Certification OPQUAST',500,0,'1.Comprendre les exigences des utilisateurs du Web et savoir répondre à leurs attentes\n2.Prendre en compte la diversité des usages, prévenir les risques et améliorer l’inclusion\n3.Consolider sa pratique avec des checklists et savoir les argumenter\n4.Maîtriser les bases du vocabulaire et communiquer avec l’ensemble des acteurs du projet Web\n5.Connaître les métiers, disciplines et s’intégrer dans les processus de conception du projet Web',NULL,'rbonnamy@diginam