NULL,NULL,NULL,NULL,'rbonnamy@diginamic.fr',NULL,254,257,'3','A l’issue de ce parcours de formation, les participants seront en mesure de :\n- Appréhender l’état de l’art des principales solutions BI et BigData\n- Maîtriser le cycle de vie d’un projet Data\n- Appréhender les concepts de l’agilité, \n- Maîtriser les outils d’alimentation et de restitution du Business Intelligence\n- Consolider et permettre d’exploiter les données massives des Big Data\n- Evoluer et communiquer au sein d’une équipe',NULL,'Une évaluation préalable à la formation a été passée sous forme de QCM en ligne, et l’apprenant a démontré ses compétences de base en gestion de données.','Maîtrise des bases du développement et connaissance du SQL.','Les data engineers constituent le maillon essentiel du processus de consolidation et de transformation des données de l’entreprise, afin de les rendre facilement accessibles par des Datascientist et/ou Data Analyst, et de développer la croissance de l’entreprise et aiguiller sa stratégie.\nCette formation pratique vise à apporter les connaissances indispensables au traitement de données, à vocation décisionnelle ou marketing. Un panorama des principales solutions du Business Intelligence et du BigData sera dressé, et permettra à l’apprenant de les mettre en œuvre dans le cadre de projets complets, des phases de modélisation des données, d’alimentation puis restitution et visualisation.\nAu-delà des technologies et bonnes pratiques, ce parcours formation vise également à apporter les clefs d’une intégration humaine réussie au sein d’une équipe projet et à offrir une compétence professionnelle reconnue associant Savoir, Savoir-Faire et Savoir-être.',NULL),(464,'\0',NULL,'2022-03-02 08:24:04.583000','TP6 - Concepteur Dév d\'Applications 3SPE - Fusion Java','TP6 CDA 3SPE','CD3SPE-MER',340,52,NULL,NULL,NULL,NULL,NULL,NULL,'Oui','rbonnamy@diginamic.fr',465,464,NULL,'1',NULL,NULL,NULL,NULL,NULL,NULL),(465,'\0',NULL,'2022-03-02 08:32:35.196000','TP6 - Concepteu