 et s’intégrer dans les processus de conception du projet Web',NULL,'rbonnamy@diginamic.fr',469,191,466,'17','Développer une application professionnelle back-end JAVA\nRéaliser une interface front-end élaborée avec Angular\nUtiliser les outils associés au cycle de vie d’une application JAVA\nAppliquer les bonnes pratiques de développement et de collaboration dans un contexte agile\nIntégrer l’ensemble des composantes technologiques et méthodologies requises sur un projet JAVA FullStack (projet de fin de formation)',NULL,'Le candidat a suivi un processus d\'admission avec entretien de motivation et évaluation des compétences.',NULL,NULL,NULL),(468,'\0',NULL,'2022-03-10 14:54:29.487000','TP6 - Concepteur Dév d\'Applications 3SPE - Fusion Java','TP6 CDA 3SPE','CD3SPE-MER',341,117,NULL,NULL,NULL,NULL,NULL,NULL,'Oui','rbonnamy@diginamic.fr',NULL,464,465,'3',NULL,NULL,NULL,NULL,NULL,NULL),(469,'\0',NULL,'2022-03-23 15:50:13.060000','Développeur-se Expert Java Full Stack','FAD','FAD',90,0,'Maîtrise de la qualité en projet Web V4-FR','OPQUAST SAS, Bordeaux','Certification OPQUAST',500,0,'1.Comprendre les exigences des utilisateurs du Web et savoir répondre à leurs attentes\n2.Prendre en compte la diversité des usages, prévenir les risques et améliorer l’inclusion\n3.Consolider sa pratique avec des checklists et savoir les argumenter\n4.Maîtriser les bases du vocabulaire et communiquer avec l’ensemble des acteurs du projet Web\n5.Connaître les métiers, disciplines et s’intégrer dans les processus de conception du projet Web',NULL,'rbonnamy@diginamic.fr',NULL,191,467,'18','Développer une application professionnelle back-end JAVA\nRéaliser une interface front-end élaborée avec Angular\nUtiliser les outils associés au cycle de vie d’une application JAVA\nAppliquer les bonnes pratiques de développement et de collaboration dans un contexte agile\nIntégrer l’ensemble des composantes technologiques et méthodologies requises sur un projet JAVA FullStack (projet de fin de formation)',NULL,'Le candidat a suivi un processus d\'admission avec entretien de motivation et évaluation des compétences.',NULL,NULL,NULL),(470,'\0',NULL,'2022-03-28 07:26:28.263000','Développeur Java Full-stack','Java Full-Stack','CDJJ1-2',57,0,'1ZO - 808','ORACLE','JAVA SE 8 Programmer',65,2,'<h5>Lien pour l\'inscription :&nbsp;&nbsp;<a class=\"nopadding text-info\" href=\"http://www.pearsonvue.com/oracle/capva/\">Site PEARSONVUE</a></h5>\n<h5>Une fois inscrit(e), veuillez renseigner votre identifiant candidat et cliquez sur sauvegarder.</h5>\n<br>\n<strong>Accès aux tests Evalbox de préparation à la certif JAVA 8:</strong>\nDes QCM de 77 questions, en autoévaluation, pour vous permettre de mieux vous préparer aux types de questions posées à l\'examen final. <br>\n- Les bonnes réponses s\'affichent une fois que vous avez fait votre choix.<br>\n- Vous pouvez les repasser 10 fois chacun. La durée max d\'un QCM est de 141mn.<br>\n- A chaque fois que vous validez une réponse, la correction est apportée en ligne.<br>\n- En fin de QCM, une note sur 20 est affichée, mais à l\'examen final, le score attendu est de 65 % de bonnes réponses : votre note doit donc être > 13/20<br>\n<br>\n<table class=\'table table-bordered table-striped order-list\'>\n	<thead><th class=\'bg-dgn\'>Test</th><th class=\'bg-dgn\'>URL</th></thead>\n	<tbody>\n		<tr>\n			<td>1</td><td><a class=\"text-info\" href=\"http://evalbox.com/register/exam/code/VXSYMDC7LUEJ\">URL</a></td>\n		</tr>\n		<tr>\n			<td>2</td><td><a class=\"text-info\" href=\"http://evalbox.com/register/exam/code/3CMQSL7QRPQC\">URL</a></td>\n		</tr>\n		<tr>\n			<td>3</td><td><a class=\"text-info\" href=\"http://evalbox.com/register/exam/code/G6MHLZEW4P2X\">URL</a></td>\n		</tr>\n		<tr>\n			<td>4</td><td><a class=\"text-info\" href=\"http://evalbox.com/register/exam/code/CJD94BYSBQPQ\">URL</a></td>\n		</tr>\n		<tr>\n			<td>5</td><td><a class=\"text-info\" href=\"http://evalbox.com/register/exam/code/53BR8V5XPPL7\">URL</a></td>\n		</tr>\n		<tr>\n			<td>6</td><td><a class=\"text-info\" href=\"http://evalbox.com/register/exam/code/ZSDKTK7MSJFV\">URL</a></td>\n		</tr>\n		<tr>\n			<td>7</td><td><a class=\"text-info\" href=\"http://evalbox.com/register/exam/code/K8W2MAW6MLED\">URL</a></td>\n		</tr>\n		<tr>\n			<td>8</td><td><a class=\"text-info\" href=\"http://evalbox.com/register/exam/code/N5EK4V78HB77\">URL</a></td>\n		</tr>\n	</tbody>\n</table>','Non','rbonnamy@diginamic.fr',NULL,448,449,'3','- Maîtriser la programmation objet et le langage JAVA en environnement JEE ;\n- Construire des interfaces graphiques avec HTML5 / CSS3 / JS / Bootstrap / Angular ;\n- Utiliser les principaux frameworks de présentation et de gestion des données ;\n- Gérer les tests et l\'intégration continue des développements ;\n- Maîtriser le cycle de vie d’un projet JAVA et l’industrialisation des développements ;\n- Appliquer les bonnes pratiques de développement dans un contexte agile ;\n- Travailler et communiquer au sein d\'une équipe projet.',NULL,'Une évaluation préalable à la formation a été passée sous forme de QCM en ligne, et l’apprenant a démontré ses compétences de base en programmation objet et connaissance d’un langage de type c# ou java.','Maîtrise d’un langage orienté objet (JAVA,\nC#, …) et des fondamentaux web (HTML,\nJavaScript, CSS)','Jeune diplômé(e) en informatique, titulaire d\'un BAC +3 / BAC+4 / BAC+5, $NOM.SOCIETE te propose un CDI en tant que développeur en informatique, précédé d\'une formation gratuite professionnalisante d\'une durée de 57 jours, afin de te rendre immédiatement opérationnel(le) pour les missions confiées par nos clients.\nAssurée par des professionnels reconnus, cette formation pratique vise à compléter et concrétiser les connaissances nécessaires pour la conception, le développement et la maintenance des applications JAVA en environnement JEE, associée à l’ensemble des technologies et frameworks utilisés en entreprise, coté back-end comme front-end.\nL’industrialisation des développements, la gestion des tests et l’intégration continue, ainsi que la conduite de projet Agile dans un contexte Scrum, sont également présentées et mises en pratique dans le cadre d’un projet fil rouge.\nDes tests seront réalisés afin de valider que les acquis et prérequis ont bien été assimilés, et cette formation s\'achève par le passage de la certification JAVA SE d’Oracle.\nAu-delà de la technique, cette formation vise également à apporter les clefs d’une intégration humaine réussie au sein d’une équipe et à offrir une compétence professionnelle reconnue, associant Savoir, Savoir-Faire et Savoir-Être !',NULL),(471,'\0',NULL,'2022-04-12 15:25:55.031000','CDA DevOps','CDAops','CDA DEVOPS',106,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Oui','hcrevan@diginamic.fr',NULL,471,NULL,'1',NULL,NULL,NULL,NULL,NULL,NULL),(472,'\0',NULL,'2022-09-01 10:43:43.705373','Business Analyst','Business Analyst','BA1',62,0,NULL,NULL,'Scrum Product Owner',0,1,NULL,'Non','rbonnamy@diginamic.fr',143,22,142,'5.1','• Appréhender l’écosystème d’un système\nd’informations ;\n• Maîtriser le cycle de vie d’un projet et la\nconception logicielle ;\n• Appréhender les méthodes agiles ;\n• Savoir innover seul ou en équipe ;\n• Spécifier les besoins utilisateurs et valider les\nlivrables logiciels ;\n• Communiquer et gérer la relation au sein de\nl’entreprise.',NULL,NULL,'BAC+5 d’une école d’ingénieur, commerce,\nfinance ou informatique et connaissance\nfonctionnelle du métier','Jeune diplômé(e) en informatique, titulaire d\'un BAC +5, $NOM.SOCIETE te propose un CDI en tant\nque Business Analyst, précédé d\'une formation gratuite professionnalisante d\'une durée de 57\njours, afin de te rendre immédiatement opérationnel(le) pour les missions confiées par nos clients.\nAssurée par des professionnels reconnus, cette formation pratique permet d’acquérir les concepts\nde la Business Analyse, pour bien comprendre et exprimer les exigences de l’organisation et\npermettre d’assurer que la solution finale est bien en adéquation avec les besoins identifiés.\nVéritable chef d’orchestre de la transformation digitale, le Business Analyst intervient dans l’analyse\nd’une problématique métier, la formalisation d’une réponse fonctionnelle, le suivi de la mise en\nœuvre logicelle et la validation des livrables jusqu’à la livraison finale de l’application.\nDes tests seront réalisés afin de valider que les acquis et prérequis ont bien été assimilés, et cette\nformation s\'achève par le passage de la certification Professional Scrum Product Owner.\nAu-delà de la technique, cette formation vise également à apporter les clefs d’une intégration\nhumaine réussie au sein d’une équipe et à offrir une compétence professionnelle reconnue,\nassociant Savoir, Savoir-Faire et Savoir-Être !',NULL),(473,'\0',NULL,'2022-09-01 10:47:51.888517','TEST','TEST','TEST',1,1,NULL,NULL,NULL,NULL,NULL,NULL,'Non','rbonnamy@diginamic.fr',474,473,NULL,'1',NULL,NULL,NULL,NULL,NULL,NULL),(474,'\0',NULL,'2022-09-01 10:48:32.476685','TEST','TEST','TEST',2,1,NULL,NULL,NULL,NULL,NULL,NULL,'Non','rbonnamy@diginamic.fr',475,473,473,'2',NULL,NULL,NULL,NULL,NULL,NULL),(475,'\0',NULL,'2022-09-01 14:10:48.906652','TEST','TEST','TEST',4,4,NULL,NULL,NULL,NULL,NULL,NULL,'Non','rbonnamy@diginamic.fr',476,473,474,'3.0',NULL,NULL,NULL,NULL,NULL,NULL),(476,'\0',NULL,'2022-09-01 14:15:49.721899','TEST','TEST','TEST',6,3,NULL,NULL,NULL,NULL,NULL,NULL,'Non','rbonnamy@diginamic.fr',477,473,475,'3.1',NULL,NULL,NULL,NULL,NULL,NULL),(477,'\0',NULL,'2022-09-01 14:17:26.497624','TEST','TEST','TEST',11,11,NULL,NULL,NULL,NULL,NULL,NULL,'Non','rbonnamy@diginamic.fr',478,473,476,'3.2',NULL,NULL,NULL,NULL,NULL,NULL),(478,'\0',NULL,'2022-09-01 14:49:50.878615','TEST','TEST','TEST',13,18,NULL,NULL,NULL,NULL,NULL,NULL,'Non','rbonnamy@diginamic.fr',NULL,473,477,'3.3','Objs.','Projet','Evals','Prérequis','Syllabus',NULL),(479,'\0',NULL,'2022-09-01 14:52:03.149069','TEST 2.0','TEST 2.0','TEST2.0',13,18,NULL,NULL,NULL,NULL,NULL,NULL,'Non','rbonnamy@digin